                'summary' => 'Depremler, doğal afetler arasında insan psikolojisi üzerinde en derin izlerden birini bırakabilir. Yaşanan sarsıntılar, can ve mal kayıpları bir yana, deprem riski taşıyan bölgelerde yaşayan birçok kişide deprem anksiyetesi adı verilen yoğun bir kaygı durumuna yol açar. Sürekli bir tedirginlik hali, en ufak bir sarsıntıda panikleme, uyku sorunları veya günlük hayata odaklanamama gibi belirtilerle kendini gösteren bu durumla başa çıkmak mümkün. İşte deprem anksiyetesiyle mücadele etmenize yardımcı olacak bazı stratejiler:',
            'content' => '<p>Depremler, doğal afetler arasında insan psikolojisi üzerinde en derin izlerden birini bırakabilir. Yaşanan sarsıntılar, can ve mal kayıpları bir yana, deprem riski taşıyan bölgelerde yaşayan birçok kişide deprem anksiyetesi adı verilen yoğun bir kaygı durumuna yol açar. Sürekli bir tedirginlik hali, en ufak bir sarsıntıda panikleme, uyku sorunları veya günlük hayata odaklanamama gibi belirtilerle kendini gösteren bu durumla başa çıkmak mümkün. İşte deprem anksiyetesiyle mücadele etmenize yardımcı olacak bazı stratejiler:</p><h3><strong>1. Bilgilenin Ama Aşırıya Kaçmayın</strong></h3><p>Depremler hakkında doğru ve güvenilir kaynaklardan bilgi edinmek, bilinmeyene karşı duyulan korkuyu azaltabilir. Ancak sürekli deprem haberleri takip etmek, sosyal medyada olası senaryoları okumak veya felaket senaryolarına odaklanmak kaygıyı artırır.</p><ul><li><b>Ne Yapmalı:</b>&nbsp;AFAD, Kandilli Rasathanesi gibi resmi kurumlardan bilgi edinin. Bilgiyi filtreleyin, spekülatif içeriklerden uzak durun.</li><li><b>Ne Yapmamalı:</b>&nbsp;Sürekli haber izlemeyin, sosyal medyada paniğe yol açan paylaşımlardan uzak durun.</li></ul><h3><strong>2. Hazırlıklı Olun ve Kontrol Hissini Geri Kazanın</strong></h3><p>Belirsizlik hissi anksiyeteyi besler. Deprem anında ve sonrasında neler yapacağınızı bilmek, kendinizi daha güvende hissetmenizi sağlar.</p><ul><li><b>Deprem Çantası Hazırlayın:</b>&nbsp;İçinde temel ihtiyaçların olduğu bir afet çantası bulundurun. Bu, olası bir durumda neye ihtiyacınız olduğunu bilmenizi sağlar.</li><li><b>Evde Güvenli Alanlar Belirleyin:</b>&nbsp;Deprem anında nereye sığınacağınızı, riskli alanlardan uzak durmanız gerektiğini öğrenin.</li><li><b>Aile Afet Planı Yapın:</b>&nbsp;Aile bireyleriyle buluşma noktaları belirleyin, iletişim planı yapın. Bu tür planlar, kontrol hissine katkıda bulunur.</li></ul><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752648830.jpg" style="width: 50%;"></p><h3><strong>3. Farkındalık (Mindfulness) ve Nefes Egzersizleri Uygulayın</strong></h3><p>Anksiyete anında zihin genellikle gelecekteki olumsuz senaryolara odaklanır. Farkındalık egzersizleri ve doğru nefes teknikleri, anı yaşamaya odaklanarak kaygıyı azaltır.</p><ul><li><b>Derin Nefes Alın:</b>&nbsp;Nefes egzersizleri (örneğin 4-7-8 tekniği), kalp atış hızınızı düşürerek sakinleşmenize yardımcı olur.</li><li><b>Şimdiki Ana Odaklanın:</b>&nbsp;Beş duyunuzu kullanarak bulunduğunuz ortama odaklanın. “Şu an ne görüyorum, ne duyuyorum, ne hissediyorum?” gibi sorularla zihninizi dağıtın.</li></ul><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752648869.webp" style="width: 50%;"></p><h3><strong>4. Fiziksel Aktiviteyi Artırın</strong></h3><p>Egzersiz, stres hormonlarını azaltarak ve endorfin salgılanmasını artırarak ruh halini iyileştirir.</p><ul><li><b>Düzenli Yürüyüşler:</b>&nbsp;Açık havada yürüyüş yapmak zihninizi temizler.</li><li><b>Yoga veya Meditasyon:</b>&nbsp;Stres yönetimi ve zihinsel rahatlama için etkilidir.</li><li><b>Sevdiğiniz Bir Spor:</b>&nbsp;Kendinizi iyi hissettiğiniz herhangi bir fiziksel aktivite faydalı olacaktır.</li></ul><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752648905.webp" style="width: 50%;"></p><h3><strong>5. Sosyal Bağlantılarınızı Güçlendirin</strong></h3><p>Kaygı duyduğunuzda kendinizi yalnız hissetmek, durumu daha da kötüleştirebilir. Sevdiklerinizle konuşmak ve duygularınızı paylaşmak önemlidir.</p><ul><li><b>Yakınlarınızla Konuşun:</b>&nbsp;Güvendiğiniz kişilerle korkularınızı paylaşın. Onların desteği size iyi gelecektir.</li><li><b>Gruplara Katılın:</b>&nbsp;Benzer deneyimler yaşayan insanlarla bir araya gelmek, yalnız olmadığınızı hissettirebilir.</li></ul><h3><strong>6. Uyku Düzeninize Dikkat Edin</strong></h3><p>Yeterli ve kaliteli uyku, hem fiziksel hem de zihinsel sağlığınız için temeldir. Anksiyete uyku düzeninizi bozsa da, uyku kalitesini artırmaya çalışmak kaygıyla başa çıkmada yardımcı olur.</p><ul><li><b>Düzenli Uyku Saatleri:</b>&nbsp;Her gün aynı saatte yatıp kalkmaya özen gösterin.</li><li><b>Uyku Ortamınızı İyileştirin:</b>&nbsp;Karanlık, sessiz ve serin bir yatak odası uyku kalitenizi artırır.</li></ul>',
