                'summary' => 'Amacınız; kas kütlesi oluşturmak veya daha fit, daha hacimli bir vücuda kavuşmak olsun. Ağırlık kaldırmak, hedefinize ulaşmanıza yardım edecektir. Ancak ilk olarak bu önemli tüyoları aklınıza not edin!',
            'content' => '<p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Amacınız; kas kütlesi oluşturmak veya daha fit, daha hacimli bir vücuda kavuşmak olsun. Ağırlık kaldırmak, hedefinize ulaşmanıza yardım edecektir. Ancak ilk olarak bu önemli tüyoları aklınıza not edin!</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Isının:</span> 5 dakikalık koşu veya tempolu yürüyüş gibi bazı aerobik aktiviteler, kaslarınıza giden kan akışını artıracak ve onları iyi bir antrenman için hazırlayacaktır. İp atlamak veya birkaç dakika jumping jack yapmak da iyi ısınma seçeneklerinden…</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Daha hafif ağırlıklarla başlayın:</span> Doğru formla 10-15 kez kaldırabileceğiniz bir ağırlıkla başlamak istersiniz. 8-12 tekrardan oluşan 2-3 setle başlayın ve yavaşça 3 set ya da daha fazlasına geçin.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Ağırlığı kademeli olarak artırın:</span> Önerilen set ve tekrar sayısını kolayca yapabildiğinizde, ağırlığı yüzde 2-10 oranında artırın. Tam bir antrenman yapmadan önce bunun sizin için doğru ağırlık olduğundan emin olun.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Setler arasında en az 60 saniye dinlenin:</span> Bu, özellikle başlarken kas yorgunluğunu önlemeye yardımcı olur.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Antrenman sürenizi optimize edin:</span> Seanslarınızı makul bir zaman diliminde tutmak, aşırı kas yorgunluğunu ve tükenme riskini önleyebilir. Unutmayın; antrenmanın etkinliği, seansı uzatmaktan ziyade yoğunluk ve bireysel fitness seviyelerine bağlıdır.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Antrenmandan sonra kaslarınızı nazikçe esnetin:</span> Esneme; esnekliğinizi artırmanıza, kas gerginliğini ve yaralanma riskinizi azaltmanıza yardımcı olabilir.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><span style="font-weight: 700;">Antrenmanlar arasında bir veya iki gün dinlenin:</span> Dinlenmek, kaslarınıza bir sonraki antrenmanınızdan önce iyileşmesi ve enerji depolarını yenilemesi için zaman tanır.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><img src="data:image/webp;base64," data-filename="zor-ama-etkili.webp" style="width: 800px;"></p><h2 style="font-family: Roboto, sans-serif; color: rgb(236, 0, 140); font-weight: 400; margin: 30px auto 20px; font-size: 27px; line-height: 38px;"><span style="font-weight: 700;">Zor ama etkili!</span></h2><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Burpee, iki parçalı bir egzersiz: Bir şınav ve ardından havaya sıçrama… Üst üste birkaç burpee yapmak yorucu olabilir ancak bu çok yönlü egzersiz, özellikle kalori yakarken ve kardiyo zindeliğini artırırken, güç ve dayanıklılık oluşturmanın bir yolunu arıyorsanız karşılığını almaya değer.</p><p style="margin-right: auto; margin-bottom: 26px; margin-left: auto; overflow-wrap: break-word; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;">Yağ yakmanın yanı sıra burpee’leri egzersiz rutininize dahil etmek, aşağıdakiler gibi birçok farklı kardiyo faydası elde etmenize de yardımcı olabilir:</p><ul style="padding: 0px; margin-bottom: 26px; margin-left: auto; margin-right: auto; color: rgb(34, 34, 34); font-family: Verdana, "system-ui", -apple-system, "Segoe UI", Roboto, Oxygen, Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif; font-size: 17px;"><li style="line-height: inherit; margin-left: 21px;