            4 => 
            array (
                'id' => 14,
                'in_title' => 'İTO Başkanı\'ndan \'Nefes Kredisi\' açıklaması',
                'out_title' => 'İTO Başkanı\'ndan \'Nefes Kredisi\' açıklaması',
                'slug' => 'ito-baskanindan-nefes-kredisi-aciklamasi',
            'summary' => 'İstanbul Ticaret Odası (İTO) Başkanı Şekib Avdagiç, "İstanbullu işletmeleri tam zamanında devreye giren TOBB Nefes Kredisinden yararlanmaya çağırıyorum." açıklamasında bulundu.',
            'content' => '<p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;"><span style="outline: none; font-weight: 700;">İTO\'dan yapılan açıklamada görüşlerine yer verilen Avdagiç, KOBİ\'lere destek olmak için Türkiye Odalar ve Borsalar Birliği (TOBB), Kredi Garanti Fonu (KGF) ve bankaların işbirliğiyle başvuruları 8-9 Temmuz 2025 itibarıyla gerçekleştirilecek TOBB Nefes Kredisine ilişkin görüşlerini paylaştı.</span></p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">TOBB Nefes Kredisine Ziraat Bankası, Halkbank, Vakıfbank, Akbank, Yapı Kredi, Denizbank ve Ziraat Katılım şubelerinin aracılık edeceğini belirten Avdagiç, "Hep dikkat çektiğimiz gibi piyasanın sağlıklı yürümesi için küçük ve mikro ölçekli işletmelerin, bankaların TL ticari kredilerdeki büyüme sınırının dışında tutulması gerekiyor." ifadelerini kullandı.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">TOBB Nefes Kredisine işletmelerin büyük teveccüh göstereceğini belirten Avdagiç, Nefes Kredisinin bankaların ticari kredi büyümesi engellerinin kaldırılmasına öncülük edeceğine inanıyorum.” değerlendirmesinde bulundu.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;"><span style="outline: none; font-weight: 700;">"Öz kaynak desteğiyle yeni KGF kredileri için bir başlangıç olmasını diliyoruz"</span></p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">İTO Başkanı Avdagiç, TOBB Nefes Kredisi ile iş dünyasının birikiminin, yine firmalara kredi olarak döneceğine dikkati çekerek, şunları söyledi:</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">"TOBB\'un öncülüğünde KOBİ\'lere 2,5 milyon TL\'ye kadar, 6 ay ödemesiz olmak üzere 36 ay vadeli Nefes Kredisi’nin uygun şartlardaki banka kredilerinin yeniden açılması ihtiyacına işaret edeceğine inanıyoruz. Özellikle öz kaynak desteğiyle yeni KGF kredileri için bir başlangıç olmasını diliyoruz."</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">Enflasyonla mücadelede gelinen noktada arzı artırmak üzere KOBİ\'lerin nakit akışının rahatlatılmasının önemli olduğunu belirten Şekib Avdagiç, "Banka kredi mekanizmalarının yeniden ve sağlıklı şekilde çalışır olması çok önemli. Kredi faizlerinin de kredi tutarlarının da üretime güçlü bir nefes verecek seviyeye ulaşmasını önemsiyoruz." dedi.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;"><span style="outline: none; font-weight: 700;">Avdagiç, Nefes Kredisi için TOBB Başkanı Rifat Hisarcıklıoğlu\'na, Kredi Garanti Fonuna ve krediye aracılık edecek bankalara teşekkür etti.</span></p>',
