            array (
                'id' => 15,
                'in_title' => '50 dev şirketten AB\'ye \'yapay zeka\' mektubu',
                'out_title' => '50 dev şirketten AB\'ye \'yapay zeka\' mektubu',
                'slug' => '50-dev-sirketten-abye-yapay-zeka-mektubu',
            'summary' => 'Avrupa\'nın önde gelen şirketlerinin yöneticileri, Avrupa Birliği\'nin (AB) yapay zekaya sınırlamalar getirecek kurallarının uygulanmasının 2 yıl ertelenmesi çağrısında bulundu.',
            'content' => '<p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;"><span style="outline: none; font-weight: 700;">AirBus, ASML, Carrefour, Lufthansa, Mercedes-Benz, Philips, BNP Paribas Axa, TotalEnergies, Siemens Energy\'nin de aralarında yer aldığı 50 Avrupa firmasının üst düzey yöneticisi, AB Komisyonu Başkanı Ursula von der Leyen\'e "Saati durdurun" başlıklı ortak imzalı bir mektup gönderdi.</span></p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">Mektupta, Avrupalı şirket yöneticileri, AB\'nin yapay zeka kullanımına ilişkin kurallarının <span style="outline: none; font-weight: 700;">"belirsiz ve karmaşık" </span>olduğuna işaret etti.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">AB yapay zeka düzenlemesinin Avrupa\'nın bu alandaki hedeflerini ve şirketlerin yapay zekayı devreye sokma yeteneklerini riske attığı belirtilen mektupta, yapay zeka konusunda herkesin işine yarayacak çözümler üretilmesinin önemine dikkat çekildi.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">Mektupta, AB yapay zeka yasası kapsamında, Ağustos 2026\'da yürürlüğe girmesi beklenen yüksek riskli yapay zeka sistemleri üzerindeki yükümlülükler ile Ağustos 2025\'te yürürlüğe girmesi beklenen genel amaçlı yapay zeka modelleri için yükümlülüklerin 2 yıl ertelenmesi çağrısında bulunuldu.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; color: rgb(51, 51, 51); font-size: 17px !important;">AB Yapay Zeka Yasası, 1 Ağustos 2024\'te yürürlüğe girmişti. Yapay zeka kullanımına aşamalı olarak katı kurallar getiren yasanın çeşitli hükümleri farklı zamanlarda uygulamaya alınıyor.</p>',
