                'slug' => 'simsek-kuresel-kosullarin-zorluklarina-ragmen-ihracat-direncli-yapisini-koruyor',
                'summary' => 'Hazine ve Maliye Bakanı Mehmet Şimşek, küresel koşulların zorluklarına rağmen ihracatın dirençli yapısını koruduğunu bildirdi.',
            'content' => '<div class="fr-view" stylex="overflow:auto" style="outline: none; color: rgb(51, 51, 51); font-family: Roboto, Arial, sans-serif; font-size: 14px;"><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; font-size: 17px !important;"><span style="outline: none; background-color: initial; text-align: initial;">Bakan Şimşek, sosyal medya hesabından makroekonomik verilerdeki gelişmeleri değerlendirdi.</span></p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; font-size: 17px !important;">Küresel koşulların zorluklarına rağmen ihracatın dirençli yapısını koruduğuna işaret eden Şimşek, "Cari açık, öngörülerimiz doğrultusunda gerçekleşirken sürdürülebilir seviyelerde kalmaya devam ediyor." ifadesini kullandı.</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; font-size: 17px !important;">Mehmet Şimşek, nisanda 381 baz puana kadar yükselen risk priminin (CDS) haziran sonu itibarıyla 283 baz puana gerilediğini aktararak şunları kaydetti:</p><p style="outline: none; margin-right: 0px; margin-bottom: 27px; margin-left: 0px; font-family: Roboto, sans-serif; line-height: 23px; font-size: 17px !important;">"İki yıllık gösterge tahvil faizi ise yüzde 49\'dan yüzde 40\'ın altına indi. CDS ve borçlanma maliyetlerindeki düşüş, kararlı ve sabırlı duruşumuzun olumlu sonuçlarını net bir şekilde ortaya koyuyor. Dezenflasyon süreciyle yurt içi finansal koşulların önümüzdeki dönemde daha da iyileşmesini bekliyoruz.</p></div>',
                'large_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1751964717.jpg',
                'news_detail_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1751964717.jpg',
