            array (
                'id' => 17,
                'in_title' => 'Yazlık dönüşü evinizi ve havanızı temizleyin',
                'out_title' => 'Yazlık dönüşü evinizi ve havanızı temizleyin',
                'slug' => 'yazlik-donusu-evinizi-ve-havanizi-temizleyin',
                'summary' => 'Yazlık sezonu kapanıp evlere dönüş başlarken, uzun süre kapalı duran, fazlaca tozlanan ve havasız kalan evlerimiz de bizi bekliyor. Bu da evdeki eşyaların üzerinde, köşelerde ve yüzeylerde toz ve kirlerin epeyce biriktiği anlamına geliyor.',
            'content' => '<p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Yazlık sezonu kapanıp evlere dönüş başlarken, uzun süre kapalı duran, fazlaca tozlanan ve havasız kalan evlerimiz de bizi bekliyor. Bu da evdeki eşyaların üzerinde, köşelerde ve yüzeylerde toz ve kirlerin epeyce biriktiği anlamına geliyor.</p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Sağlıklı bir ortam oluşturmak için temizliğe başlamadan önce bilmeniz gereken bazı detaylar var. Evinizdeki toz maruziyetini azaltmak için zeminlerinize ek olarak yataklarınızı, koltuklarınızı ve ulaşılması zor yerleri etkili filtre sistemine sahip bir süpürgeyle temizlemeyi ihmal etmeyin. Süpürgenizin, kirli havayı hapsedip ortama geri vermemesine dikkat edin. Süpürmek tek başına temizlik için yeterli değildir. Zeminlerin silinmesi de evlerdeki tozun kontrol altına alınmasına yardımcı olur. İç mekân havasını kontrol altında tutabilmek adına tamamen kapalı filtre sistemine sahip bir hava temizleyici tercih edebilirsiniz.</p><h3 class="wp-block-heading" style="margin: 30px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(0, 0, 0); text-transform: uppercase;">HAVANIZIN YETERİNCE TEMİZ OLDUĞUNDAN EMİN OLUN</h3><p style="margin: 30px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(0, 0, 0); text-transform: uppercase;"><img src="data:image/jpeg;base64," data-filename="dyson-1.jpg" style="width: 50%;"></p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Hijyen sağlamanın en önemli yöntemlerinden biri ev ortamına temiz havanın hakim olması. İç mekanlardaki havayı daha temiz tutmak için tasarlanan Dyson hava temizleyiciler, havadaki zararlı maddeleri tespit edip hapsetmenin yanı sıra sıcak havalarda klima soğuğunu sevmeyenlere de serinletici bir alternatif sunuyor.</p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);"><strong style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit;">Yüzde 20 daha sessiz çalışacak şekilde akustik açıdan yeniden tasarlanan Dyson Purifier Cool™ Formaldehyde hava temizleyici:</strong></p><ul class="wp-block-list" style="box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 40px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(88, 88, 88);"><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Odanın havasını doğru şekilde temizlemek için gereken standart test koşullarının ötesine geçerek, partikülleri ve gazları otomatik olarak algılıyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Tamamen yalıtımlı HEPA 13 standardında filtrelemeyle ultra ince partikülleri yüzde 99,95 oranında yakalıyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Formaldehiti tespit ediyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Air Multiplier™ teknolojisiyle temizlenmiş havayı dağıtıp yayıyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Ortamı dilediğiniz zaman serinletebiliyor.</li></ul><h3 class="wp-block-heading" style="margin: 30px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(0, 0, 0); text-transform: uppercase;">DOĞRU ELEKTRİK SÜPÜRGESİNİ SEÇİN</h3><p style="margin: 30px 0px 10px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; font-size: 16px; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(0, 0, 0); text-transform: uppercase;"><img src="data:image/jpeg;base64," data-filename="DYSON-2.jpg" style="width: 50%;"></p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Elektrikli süpürgeler söz konusu olduğunda herkese uyan tek bir model yoktur. Farklı zemin tipleri ve ev boyutları için farklı elektrikli süpürgeleri vardır. Eviniz için doğru süpürgeyi seçmek, evinizi temizleme kolaylığı ve hızında büyük değişim yaratacaktır.</p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);"><strong style="margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit;">Dyson Gen5detect™ kablosuz süpürge:</strong></p><ul class="wp-block-list" style="box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 40px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(88, 88, 88);"><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Yeni nesil Hyperdymium™ motora sahip.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Yüksek kaliteli temizlik performansı ve emiş gücü bulunuyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Derinlemesine bir temizliğin bilimsel kanıtı için mikroskobik tozu tespit edip temizliyor ve hesaplıyor.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Tüm makineyi kapsayan ve tamamen sızdırmaz bir HEPA filtreleme sistemine sahip.</li><li style="margin: 0px 0px 5px; padding: 0px 0px 0px 4px; border: 0px; font: inherit; vertical-align: baseline; box-sizing: inherit;">Ayrıca HEPA filtreyle ultra ince partiküllerin yüzde 99,9’unu yakalayıp hapsediyor.</li></ul>',
