            8 => 
            array (
                'id' => 18,
                'in_title' => 'Sadeliğin kusursuzluğu',
                'out_title' => 'Sadeliğin kusursuzluğu',
                'slug' => 'sadeligin-kusursuzlugu',
                'summary' => 'Gaggenau organizasyonuna Onur Baştürk, Banu Savcı, Selin Demiratar, Melis Goral, Merve Üründül, Akasya Asıl Türkmen, Hande Can ve Çiler Geçici gibi sanat ve basın dünyasından seçkin davetliler katıldı.',
            'content' => '<p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Gaggenau organizasyonuna Onur Baştürk, Banu Savcı, Selin Demiratar, Melis Goral, Merve Üründül, Akasya Asıl Türkmen, Hande Can ve Çiler Geçici gibi sanat ve basın dünyasından seçkin davetliler katıldı.</p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Lüks mutfak aletleri markası Gaggenau, devrim niteliğinde olan Gizli İndüksiyonlu Ocağını (Essential Induction), Cosentino City’de gerçekleştirdiği harika bir gecede tanıttı. Yeniliğin en saf formunu sunan ocak, mutfak tezgahına entegre edilmiş yalnızca bir nokta, bir yüzey ve bir düğme ile sadeliğin kusursuz dünyasını yansıtarak seçkin konuklarını etkiledi.</p><div><img src="data:image/jpeg;base64," data-filename="3-Ekim-GaggenauCosentino-Lansman-4.jpg" style="width: 50%;"></div><div><br></div><div><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Gaggenau’nun zamansız tasarımı Gizli İndüksiyonlu Ocaklar, (Essential induction),Dekton tezgahlarla entegre olup, İkonik paslanmaz çelik veya siyah yüksek hassasiyetli kontrol düğmeleriyle tamamlanabilen, çok çeşitli tezgah renk ve kaplama seçenekleriyle her türlü tasarım vizyonunu gerçeğe dönüştürmektedir. Tezgah yüzeyinin altında yer alan iki farklı boyuttaki indüksiyon modülü farklı pişirme ihtiyaçlarını karşılamak üzere birleştirilebilmektedir.</p></div><div><img src="data:image/jpeg;base64," data-filename="3-Ekim-GaggenauCosentino-Lansman-1.jpg" style="width: 50%;"></div><div><br></div><div><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Pişirme bölgesinin içindeki akıllı merkez ışığı olan nokta, kullanıcıya pişirme kaplarını nereye yerleştireceğini gösterirken, kalan ısı konusunda uyarır ve kullanılmadığında kaybolur.<br style="box-sizing: inherit;">Gaggenau’nun yüksek performanslı 21 cm ve 28 cm indüksiyon modülleri, geniş ve birleşik çok amaçlı bir pişirme yüzeyi oluşturur.</p><p style="margin-right: 0px; margin-bottom: 20px; margin-left: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-variant-alternates: inherit; font-variant-position: inherit; font-variant-emoji: inherit; font-stretch: inherit; line-height: inherit; font-family: "Open Sans", Helvetica, Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; vertical-align: baseline; box-sizing: inherit; color: rgb(88, 88, 88);">Bu kusursuz tasarım; sadece yemek pişirme şeklini değil, aynı zamanda modern, açık planlı mutfakta etkileşim ve sosyalleşme şekillerini de değiştirecek bir devrim niteliğindedir.</p></div><div><img src="data:image/jpeg;base64," data-filename="3-Ekim-GaggenauCosentino-Lansman-3.jpg" style="width: 50%;"><br></div>',
