                'slug' => 'olaganustu-sesiyle-tum-dunyayi-buyuleyen-andrea-bocellinin-oglu',
                'summary' => 'Dünyaca ünlü tenor Andrea Bocelli’nin oğlu olarak müziğin içinde büyüyen Matteo Bocelli, köklü bir klasik mirasın gölgesinde değil, onunla birlikte yürümeyi seçiyor. Hem babasının izinden giden hem de kendi sanatsal yolculuğunu inşa eden Matteo, duygulara dokunan melodileri ve güçlü sahne enerjisiyle dikkat çekiyor. Klasik ile çağdaş müziği ustalıkla harmanlayan genç sanatçı, 17 haziran’da Harbiye Cemil Topuzlu Açıkhava Tiyatrosu’nda sahnedeydi. \'Summer Nights\' konseptiyle düzenlenen bu özel gecede, Matteo Bocelli yalnızca notalara değil, kalplere de dokundu. “Sadece kendime özgü, samimi hissettiren müziği yapmak istiyorum”',
                'content' => '<p dir="ltr">Dünyaca ünlü tenor Andrea Bocelli’nin oğlu olarak müziğin içinde büyüyen Matteo Bocelli, köklü bir klasik mirasın gölgesinde değil, onunla birlikte yürümeyi seçiyor. Hem babasının izinden giden hem de kendi sanatsal yolculuğunu inşa eden Matteo, duygulara dokunan melodileri ve güçlü sahne enerjisiyle dikkat çekiyor. Klasik ile çağdaş müziği ustalıkla harmanlayan genç sanatçı, 17 haziran’da Harbiye Cemil Topuzlu Açıkhava Tiyatrosu’nda sahnedeydi. \'Summer Nights\' konseptiyle düzenlenen bu özel gecede, Matteo Bocelli yalnızca notalara değil, kalplere de dokundu. “Sadece kendime özgü, samimi hissettiren müziği yapmak istiyorum”</p><p><b id="docs-internal-guid-f92a1f30-7fff-4209-f494-5a17995a4642"><br></b></p><p dir="ltr">RÖPORTAJ: BÜŞRA NAZLAN ÜREGÜL</p><p><b><br></b></p><p dir="ltr">Bazen müzik yalnızca kulağımızdan geçip gitmez; kalbimize yerleşir, hafızamızda iz bırakır. Bu etkiyi yaratan sanatçılardan biri, hiç kuşkusuz Andrea Bocelli. Olağanüstü tenor sesiyle tüm dünyayı büyüleyen Bocelli, yalnızca sahnelerde değil, evinde de müziği bir yaşam biçimi olarak sürdürüyor. Şimdiyse bu mirası, hem sürdüren hem de kendi yolunu çizen oğlu Matteo Bocelli ile yepyeni bir boyuta taşıyorlar. Dünyaca ünlü tenor Andrea Bocelli’nin oğlu Matteo Bocelli, sahnedeki ilk adımını babasıyla söylediği ‘Fall On Me’ adlı parçayla attı. Bu düet, yalnızca bir müzikal birliktelik değil, aynı zamanda kuşaklar arası bir duygusal aktarımın sembolüydü. Matteo bu anı şöyle anlatıyor: “O şarkı benim için her şeyin başlangıcı oldu. İlk kez büyük bir dinleyici kitlesiyle kendimi paylaştım ve bunu babamla birlikte yapmak çok özeldi.” Baba Andrea Bocelli, dünya turnesine mola verdiği sırada, eşi Verónica Berti ile birlikte Miami’deki malikanesinde geçtiğimiz aylarda HOLA! İspanya edisyonumuzu ağırlamıştı. 66 yaşındaki sanatçı, bugüne kadar 80 milyondan fazla albüm sattı; Roma Kolezyumu’ndan Mısır piramitlerine kadar birçok rüya mekanda sahne aldı, uluslararası üne sahip isimlerle birlikte şarkı söyledi, kraliyet aileleri önünde performans sergiledi. Hatta Céline Dion onun için şöyle demişti; “Eğer Tanrı şarkı söyleyebilseydi, Andrea Bocelli gibi söylerdi.”</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752318330.jpg" style="width: 764px;"><br></p><p><b><br></b></p><p dir="ltr">Bocelli yalnızca bir tenor değil; müzisyen, yapımcı, yönetmen, şair... Gerçek bir orkestra adamı. Hem klasik müzik hem de pop dünyasında hayranlık uyandıran kariyeri, onu yaşayan bir efsaneye dönüştürdü. Üstelik 12 yaşından beri görme engelli olması, başarılarının değerini daha da artırıyor. Baba Bocelli, o gün verdiği röportajda ailesinin kendi si için ne kadar önemli olduğundan şu sözlerle bahsetmişti: “Aile bizim için bir aşk projesidir. İyilik, anlayış ve diyalog gibi temel değerleri içinde barındırır. Sihirli bir formülü yok; ama kararlılık, bağlılık ve hayata olumlu bakış, her ilişkinin temelidir.”</p><p><b><br></b></p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752318327.jpg" style="width: 857.625px;"><b><br></b></p><p dir="ltr">Matteo içinse sözlerine şöyle devam etmişti: “Matteo’nun Sebastian Yatra ile iş birliği yapmasından ve Viña del Mar Festivali’ne katılmasından büyük bir memnuniyet duyuyorum. Şimdi Matteo aynı zamanda meslektaşım oldu. Profesyonel olarak olgun bir sanatçı haline geldi ve halktan büyük bir kabul görüyor. Ayrıca hazırlıklı ve seçici bir izleyici kitlesi tarafından da takdir edilmesi beni gururlandırıyor.”&nbsp;</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr">Mirası devralan Matteo Bocelli için müzik, çocukluğundan beri hayatının merkezinde yer alıyor. Eğitimli bir piyanist olan Matteo, genç yaşına rağmen sahneye adım attığı ilk günden bu yana adından söz ettiriyor. Genç sanatçı, klasik müzikle harmanladığı çağdaş pop tarzıyla, duyguları önceleyen ve anlam yüklü eserler ortaya koyuyor. Dijital çağın dinamiklerini de yakından izleyen Matteo, sosyal medyanın sanatçılar için iki ucu keskin bir kılıç olduğunu belirtiyor. Hayranlarıyla anında iletişim kurabilmenin sunduğu fırsatları takdir etse de sürekli paylaşım yapma baskısının zaman zaman yorucu olduğunu dile getiriyor. 17 Haziran’da Harbiye Cemil Topuzlu Açıkhava Tiyatrosu’nda sahne alan Matteo Bocelli, bu konserle Türkiye’deki hayranlarıyla ilk kez buluştu. \'Summer Nights\' konseptiyle seyircilere sadece bir konser değil, unutulmaz bir yaz gecesi armağan eden Matteo Bocelli, müziğin birleştirici gücünü sahnede yeniden inşa ederek yeni bir dönem oluşturuyor.</p><p><b><br></b></p><p dir="ltr">HELLO!: Müzik her zaman ailenizin hayatının bir parçası olmuştur. İlk kez sahneye çıktığınızda nasıl hissettiniz? Aileniz bu konuda sizi nasıl destekledi?</p><p dir="ltr">Matteo Bocelli: İlk kez sahneye çıktığımda hem heyecanlıydım hem de gergindim. Ailem bana çok destek oldu.</p><p><b><br></b></p><p dir="ltr">HELLO!: Dünyaca ünlü tenor Andrea Bocelli olan babanızla aynı müzik alanında olmanız sizin için daha çok bir avantaj mı, yoksa zaman zaman baskı hissetmenize neden olan bir durum mu?</p><p dir="ltr">M. Bocelli: Her ikisi de. Elbette büyük bir onur; ama aynı zamanda baskı da var. İnsanlar belirli şeyler bekliyor. Ben sadece kendime doğru gelen bir şey inşa etmeye odaklanmaya çalışıyorum. Bu ismi taşımaktan gurur duyuyorum; ama aynı zamanda kendi hikayemi de anlatmak istiyorum.</p><p><b><br></b></p><p dir="ltr">HELLO!: Babanızla birlikte söylediğiniz ‘Fall On Me’ şarkısı birçok insana duygusal anlar yaşattı. Bu düet sizin için ne ifade ediyor? Bu süreçte öğrendiğiniz en değerli şey neydi?</p><p dir="ltr">M. Bocelli: O şarkı benim için her şeyin başlangıcı oldu. İlk kez büyük bir dinleyici kitlesiyle kendimi paylaştım ve bunu babamla birlikte yapmak çok özeldi. O dönemde müzik, performans ve insanların önünde şarkı söylemenin ne anlama geldiği hakkında çok şey öğrendim.</p><p><b><br></b></p><p dir="ltr">HELLO!: 21. yüzyıl pop müziğine klasik bir dokunuş katan tarzınız, birçok kişi tarafından yenilikçi olarak değerlendiriliyor. Müzikal kimliğinizi nasıl tanımlarsınız?</p><p dir="ltr">M. Bocelli: Klasik, pop, hatta bazen biraz rock gibi... Büyürken dinlediğim her şeyin bir karışımı sanki. Melodileri, güçlü duyguları ve anlamlı sözleri seviyorum. Sadece kendime özgü, samimi hissettiren müziği yapmak istiyorum.</p><p><b><br></b></p><p dir="ltr">HELLO!: 17 Haziran’da İstanbul Harbiye Cemil Topuzlu Açık Hava Tiyatrosu’nda sahnedeydiniz. Türkiye’de ilk kez sahneye çıkmanız size nasıl hissettirdi?</p><p dir="ltr">M. Bocelli: Çok heyecanlıydım. Mekan ve Türk seyircileri hakkında harika şeyler duymuştum; tutkulu ve enerji dolu olduklarını. Sonunda bunu bizzat deneyimledim! Harika bir geceydi.</p><p><b><br></b></p><p dir="ltr">HELLO!: \'Summer Nights\' konsepti seyirciyle nasıl bir bağ kurmayı hedefliyordu? İstanbul konserinde bu bağ nasıl bir atmosfer yarattı?</p><p dir="ltr">M. Bocelli: \'Summer Nights’ın ardındaki fikir; sıcak, duygusal, unutulmaz anlar yaratmak ve seyircinin yaz anılarının bir parçası olmak üzerine kurulu. Güçlü ve dokunaklı şarkıları seslendirmek hoşuma gidiyor; ama aynı zamanda dans etmek için eğlenceli şarkıları da seviyorum.</p><p><b><br></b></p><p dir="ltr">HELLO!: Şarkılarınızda güçlü duygular ve samimi hikayeler hissediliyor. Müzikle nasıl bir bağ kuruyorsunuz? Duygularınızı yazıya ve notalara nasıl aktarıyorsunuz?</p><p dir="ltr">M. Bocelli: Müzik günlük hayatımın bir parçası. Müzik yaparken, süreç her seferinde farklı görünebilir. Sürece güvenmek en iyi yaklaşımdır ve aşırı baskıdan kaçınmak gerekir. Bir sanatçı olarak büyüdükçe, şarkı yazma becerimi her zaman geliştirmek istiyorum.</p><p><b><br></b></p><p dir="ltr">HELLO!: Sosyal medya ve dijital çağ, sanatçılar için hem büyük bir fırsat hem de ciddi bir zorluktur. Dijital çağda sanatçılık nasıl değişti sizce?</p><p dir="ltr">M. Bocelli: Bu, iki ucu keskin bir kılıç. Bir yandan, dünyanın her yerindeki hayranlarımızla anında bağlantı kurabilmemiz harika. Öte yandan bu, çok zorlayıcı olabilir. Sosyal medyada çok kötüyüm, menajerim her gün beni arayıp daha aktif olmam ve paylaşım yapmam için uyarıyor.</p><p><b><br></b></p><p dir="ltr">HELLO!: Müzik kariyerinize baktığınızda, “Bunu yaptığım için mutluyum” dediğiniz en özel an neydi?</p><p dir="ltr">M. Bocelli: Muhtemelen geçen yıl Şili’deki Vina del Mar’da sahne aldığım andı. Seyircinin ve ülkenin bir performansa verdiği tepkiyi görmek gerçekten çılgınca bir deneyimdi. O geceyi her zaman hatırlayacağım.</p><p><b><br></b></p><p dir="ltr">“MATTEO BENİ GURURLANDIRIYOR”&nbsp;</p><p dir="ltr">Andrea Bocelli, Miami’deki malikanesinde geçtiğimiz aylarda HOLA! İspanya edisyonumuzu ağırlamıştı. Hem klasik müzik hem de pop dünyasında hayranlık uyandıran kariyeri, onu yaşayan bir efsaneye dönüştürdü. Baba Bocelli, o gün verdiği röportajda oğlundan şu sözlerle bahsetmişti: “Matteo’nun Sebastian Yatra ile iş birliği yapmasından ve Viña del Mar Festivali’ne katılmasından büyük bir memnuniyet duyuyorum. Şimdi Matteo, aynı zamanda meslektaşım oldu. Profesyonel olarak olgun bir sanatçı haline geldi ve halktan büyük bir kabul görüyor. Ayrıca hazırlıklı ve seçici bir izleyici kitlesi tarafından da takdir edilmesi beni gururlandırıyor.”</p><p><b><br></b></p><p dir="ltr">“Summer Nights’ın ardındaki fikir; sıcak, duygusal, unutulmaz anlar yaratmak ve seyircinin yaz anılarının bir parçası olmak üzerine kurulu.”</p><p><br></p><p dir="ltr">“Çok heyecanlıydım. Türk seyircisi hakkında harika şeyler duymuştum; tutkulu ve enerji dolu olduklarını. Bunu bizzat deneyimledim! Harika bir duyguydu.”</p>',
