                'id' => 25,
                'in_title' => 'Atarlı giderli şarkılar',
                'out_title' => 'Atarlı giderli şarkılar',
                'slug' => 'atarli-giderli-sarkilar',
                'summary' => 'Olivia Rodrigo, Joshua Bassett ve Sabrina Carpenter arasındaki aşk üçgeni, sadece dedikodularla sınırlı kalmadı, hit şarkılarla müzik listelerine taşındı. Peki, bu şarkılarda gerçekten birbirlerine göndermeler var mı?',
                'content' => '<p dir="ltr">Olivia Rodrigo, Joshua Bassett ve Sabrina Carpenter arasındaki aşk üçgeni, sadece dedikodularla sınırlı kalmadı, hit şarkılarla müzik listelerine taşındı. Peki, bu şarkılarda gerçekten birbirlerine göndermeler var mı?</p><p><b id="docs-internal-guid-0b726b6d-7fff-b91f-9149-aeef421b44c4"><br></b></p><p dir="ltr">Yazı: İrem Naz Güvel</p><p><b><br></b></p><p dir="ltr">Eski defterler açıldı</p><p dir="ltr">Hafızalarımızı biraz zorlayalım ama çok da uzağa gitmeyelim. 2020’de “High School Musical: The Musical: The Series” dizisi yayınlamış ve dizinin başrol oyuncuları Olivia Rodrigo ve Joshua Bassett’ın ilişkisi olduğu iddia edilmişti. Olivia, röportajlarında “rol arkadaşını” çok sevdiği söylüyor ve “Onu çok seviyorum. O benim en iyi arkadaşım, bu da oyunculuğu gerçekten otantik ve gerçek kıldı. Sanki oyunculuk yapmıyormuşum gibiydi” </p><p dir="ltr">Aşk üçgeni ufukta göründü</p><p dir="ltr">Birkaç ay sonra Olivia ve Joshua çiftinin ayrıldıkları öne sürüldü. Joshua, Sabrına Carpenter ile birlikte görüldü. İlişkilerini resmi olarak duyurmasalar da, birlikte çekilen fotoğrafların giderek artması söylentileri güçlendirdi. Özellikle öğle yemeği yerken samimi bir şekilde görüntülenmeleri spekülasyonları daha da alevlendirdi. Aslında hiç kimse ilişkilerini açıkça doğrulamamıştı, sadece iddialar vardı. Bu aşk üçgenini kesin olarak öğrendiğimiz an ise bir şarkıyla geldi: “Drivers License”.</p><p><b><br></b></p><p dir="ltr">İkonik şarkı doğdu&nbsp;</p><p dir="ltr">Olivia, 2021’in ilk ayında bu şarkıyı yayınladı ve şarkı büyük bir patlama yaptı. Billboard listelerinde 1 numaraya yükseldi, yılın en çok dinlenen şarkılarından biri oldu ve bir yıl sonra Olivia’ya Grammy kazandırdı. Pek çok hayran, şarkının Joshua ve Sabrina ile olan söylentilere dayandığını düşünüyor ve özellikle şu sözlere dikkat çekiyordu: “Muhtemelen beni her zaman şüpheye düşüren o sarışın kızla birliktesin / O benden çok daha yaşlı, güvensiz olduğum her şey o.” Başlangıçta şarkı sözlerinde “esmer kız” ifadesi yer alırken, Olivia’nın bunu sonradan “sarışın kız” olarak değiştirdiği ortaya çıktı. Bu da söz konusu kişinin Sabrina olduğu iddialarını güçlendirdi.</p><p><b><br></b></p><p dir="ltr">“Olivia ‘yalan’ söylüyor”</p><p dir="ltr">“Drivers License” adeta tüm sırları açığa çıkardı ve çeşitli suçlamalara neden oldu. Hikayenin diğer kahramanı Joshua ise birçok kişinin Olivia’ya yanıt olarak yazdığını düşündüğü “Lie Lie Lie” adlı bir şarkı yayımladı. Şarkının Olivia’nın iddialarına bir gönderme olduğu düşünülse de Joshua, bu parçayı “Uzun süredir arkasından yalan söyleyen bir arkadaşına” ithaf ettiğini açıkladı.</p><p><b><br></b></p><p dir="ltr">Şarkı atışması</p><p dir="ltr">Bu aşk üçgeninin ortaya çıkardığı tek şarkı “Drivers License” değildi. Üçlü, müzik aracılığıyla birbirlerine birçok kez göndermede bulundu. Ancak günümüzde hepsinin aralarının gayet iyi olduğu, ödül törenlerinde yan yana gülerken görülmelerinden anlaşılıyor. Bu olay örgüsüne dair şarkılara bir göz atalım.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr">“Skin”</p><p dir="ltr">“Belki o zaman şöyle bir rol yapabiliriz / Yazdığımız kelimelerde hiçbir ağırlık yok / Belki de bunu kastetmedin / Belki de “sarışın” tek uyaktı” Olivia’nın “Drivers License” şarkısını yayımlamasından tam iki hafta sonra, Sabrina ona “Skin” adlı şarkısıyla yanıt verdi. Sabrina, bu şarkının Olivia’ya yönelik bir diss olmadığını şu sözlerle açıkladı: “Muhteşem bir şarkıdaki birkaç dizeden rahatsız olmadım ve bunun hakkında bir diss parçası yazmadım. Hayatımın bir dönüm noktasındaydım. Bu yüzden başa çıkmak için her zamanki yaptığım şeyi yapmaya, geçmişte kendime söyleyebilmeyi dilediğim bir şeyi yazmaya ilham aldım. Şarkı, tek bir kişiyi hedef almıyor.”</p><p><b><br></b></p><p dir="ltr">“Deja Vu”</p><p dir="ltr">“Onu arar mısın, neredeyse adımı söyler misin? / Çünkü dürüst olalım, onunla biraz aynıyız / Başka bir aktris /Sadece senin tipin olduğumu düşünmekten nefret ediyorum” Olivia, “Drivers License”dan birkaç ay sonra “Deja Vu” adlı bir başka hit şarkı yayınladı. Bu şarkıda, eski sevgilisinin kendisine benzeyen bir oyuncuyla birlikte olduğunu ima ediyor. Olivia gibi Sabrina da hem oyuncu hem de şarkıcı. Hatta hayranlar, isimlerinin de kafiyeli olduğuna dikkat çekti.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr">“Because I Liked a Boy”</p><p dir="ltr">“Dilinde sıcak bir konuyum / Gençlerden çalarak etrafta dolaşan bir geri dönenim / Bana kim olduğumu söyle, sanırım başka seçeneğim yok / Hepsi bir çocuktan hoşlandığım için.”</p><p dir="ltr">Temmuz 2022’de Sabrina, “Because I Liked a Boy” adlı şarkının yer aldığı beşinci stüdyo albümü “Emails I Can’t Send’i yayınladı. Hayranlar, şarkının Olivia ve Joshua ile yaşadığı dramaya gönderme yapıyor olabileceğini belirtti. Hayranlar, şarkının Olivia ve Joshua ile yaşadığı drama hakkında olabileceğini düşündü. Sabrina, bu şarkıda kendisini aşk üçgeninin “kötü karakteri” olarak görmeye başlayan insanların algılarına ve toplumun acımasız tepkisine değiniyor. Şarkı, Joshua ile ilişkisinin masumiyetini ve sırf bir çocuktan hoşlandığı için maruz kaldığı sert eleştirileri anlatıyor.</p><p><b><br></b></p><p dir="ltr">“Lacy”</p><p dir="ltr">“İstediğim tek şeye sahipsin”&nbsp;</p><p></p><p dir="ltr">Temmuz 2023’te Olivia, “Lacy” adlı şarkısını yayımladı ve bu şarkının anlamı hayranları ikiye böldü. Bazıları, şarkının Sabrina hakkında olduğunu düşünüyor. Şarkının Sabrina’nın Taylor Swift ile olan arkadaşlığına ya da Joshua ile ilişkisine bir gönderme olabileceği öne sürüldü. Olivia’nın “Göz kamaştırıcı starlet, Bardot reenkarne” dizesinde bahsettiği kişi de hayranlar arasında tartışma konusu oldu. Brigitte Bardot ve Sabrina Carpenter’ın benzer vücut tipine ve sarışın saçlara sahip olmaları nedeniyle, “Lacy”nin Sabrina’ya gönderme yaptığına inanılıyor.</p><div><br></div>',
