                'slug' => 'manhattan-projesi',
                'summary' => 'Einstein ve Oppenheimer’in bombayı Hitler’den önce üretme çabaları kapsamında çölde yürütülen bir bilim projesi savaşın kazanılmasına nasıl yardımcı oldu?',
            'content' => '<p dir="ltr">Einstein ve Oppenheimer’in bombayı Hitler’den önce üretme çabaları kapsamında çölde yürütülen bir bilim projesi savaşın kazanılmasına nasıl yardımcı oldu?</p><p><b id="docs-internal-guid-821d1aac-7fff-6388-47eb-f901326a6b60"><br></b></p><p dir="ltr">Albert Einstein, 2 Ağustos 1939’da ABD Başkanı Franklin D. Roosevelt’e bir mektup gönderdi. Einstein mektubunda, Nazi Almanya’sında yakın zamanda keşfedilen nükleer füzyon tekniğinin “yeni bir türde son derece güçlü bombaların” üretilmesine yol açabileceği uyarısında bulunuyordu. Aslında Macar kökenli fizikçi Leo Szilard tarafından yazılmış olan mektupta, Almanların o dönemde böyle bir silah geliştirmeye çalıştıkları ima ediliyordu. Szilard, Hitler’i durdurmanın tek yolunun atom bombası yapma yarışında onu geçmek olduğuna inanıyor ve Einstein’ın ününden yararlanarak Roosevelt’i bir ABD atom programı başlatmaya ikna edebileceklerini umuyordu. Bu girişim işe yaradı ve Roosevelt’in Uranyum Danışma Komitesi ilk toplantısını 21 Ekim 1939’da, yani İkinci Dünya Savaşı’nın patlak vermesinden sadece birkaç hafta sonra yaptı.</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319235.jpg" style="width: 553px;"><br></p><p><b><br></b></p><p dir="ltr">Aralık 1941’de Pearl Harbor’a yapılan saldırının ardından ABD nihayet savaşa girdiğinde, kendisini iki cephede birden savaşırken buldu. ABD’nin karşısında batıda Nazi Almanya’sı, doğuda ise Japonya vardı. Roosevelt artık atom projesine öncelik veriyordu ve bu nedenle ABD Kara Kuvvetleri İstihkâm Kolordusu’nu bir bomba yapmakla görevlendirdi. Birlik, New York Broadway’de bulunan bir gökdelenin 18. katında ofis kurarak tarihteki en büyük hükümet destekli bilim programı niteliğini kazanacak olan bu proje üzerinde çalışmaya başladı. Çalışmaların amacını gizli tutmak için, pencereden baktıkları zaman gördükleri bölgenin adı projeye verildi. Böylece 13 Ağustos 1942’de Manhattan Projesi doğdu.</p><p><b><br></b></p><p dir="ltr">Bu çok gizli projenin başına Pentagon’un inşasını da denetlemiş olan Korgeneral Leslie Groves getirildi. Olağanüstü azimli bir adam olan Groves hemen yüzlerce ton uranyum cevheri temin etmeye, geniş araziler satın almaya ve sonunda sayısı yarım milyonu aşacak olan işgücünün ilk üyelerini istihdam etmeye başladı. Korgeneral Groves’un Manhattan Projesi’nin bilim kadrosunu yönetmek için seçtiği kişi Dr. Robert Oppenheimer’dı. Zeki ve karizmatik bir teorik fizikçi olan Oppenheimer ile pragmatik ve çalışkan bir asker olan Groves ikilisi birlikte müthiş bir ekip oluşturacaktı. Proje için getirilen diğer bilim adamlarının içinde o dönemde dünyadaki en iyi beyinlerden bazıları vardı. Bu kişiler arasında o zamana kadar Nobel ödülü almış ve daha sonra bu ödülü alacak olan toplam 26 kişi vardı. Programı başlatan Szilard da bu sayıya dahildi.&nbsp;</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319236.jpg" style="width: 50%;"><br></p><p><b><br></b></p><p dir="ltr">Manhattan Projesi’nin ölçeği o kadar büyüktü ki araştırma ve geliştirme faaliyetleri ABD’nin dört bir yanına yayıldı. Ancak en önemli üç yer: Plütonyumun üretildiği Washington’daki Hanford; uranyum zenginleştirme işleminin yapıldığı Tennessee’deki Oak Ridge ve silahın geliştirilip sonunda test edileceği New Mexico’daki Los Alamos idi.&nbsp;</p><p><b><br></b></p><p dir="ltr">Oppenheimer ve ekibi, 1944 baharında nihayet çalışabilecek bir bomba tasarımı ortaya koydu. Ateşleme mekanizması bir topunkine benziyordu: İki parça nükleer yakıt birbirine çarptırılarak nükleer patlama için gerekli kritik kütle oluşturulacaktı. Bu tasarımı kullanarak yaptıkları bombanın kod adı ise “Little Boy” olacaktı. Ancak bir sorun vardı çünkü bomba test edilemiyordu. Tasarım sadece uranyum-235 ile çalışacaktı ve bilim adamlarının elinde bu nadir izotoptan sadece bir patlamaya yetecek kadar vardı. Nazilerin hâlâ kendi bombaları üzerinde çalıştıkları bilindiğinden, hızlı bir şekilde bir alternatif bulunması gerekiyordu.</p><p><b><br></b></p><p><b><br></b></p><p dir="ltr">Bunun üzerine bilim insanları plütonyumla çalışacak bir tasarım üzerinde kafa yormaya başladılar. 1944’ün geri kalan döneminde bu sorunla boğuştular ve buldukları çözüm “Little Boy” için tasarlanandan çok daha karmaşıktı. Ortaya çıkardıkları ikinci bomba, top mekanizmasını esas almak yerine içten patlama yöntemini kullanacaktı. Bu maksatla bombanın merkezine greyfurt büyüklüğünde bir plütonyum yerleştirilecek ve bunun etrafına konvansiyonel patlayıcılar konulacaktı. Bunlar patlatıldığında, plütonyum çok kritik bir noktaya kadar sıkıştırılarak, nükleer patlamaya yol açacak bir zincirleme reaksiyonu tetikleyecekti. İlk prototip plütonyum bombası olarak bilinen “alet” 16 Temmuz 1945’te test edilmeye hazırdı. Bu ana ulaşmak için üç yıl çalışılmış ve 2 milyar dolar para harcanmıştı. Sabah saat 5.30’da bomba New Mexico çölünün ortasında bulunan 30 m yüksekliğindeki çelik bir kulede patlatıldı. Ortaya çıkan patlama 320 km uzaklıktan görülebiliyordu.</p><p><b><br></b></p><p dir="ltr">Nazilerin atom bombası yapacağı korkusu Manhattan Projesi’ne ilham vermiş olsa da proje amacına ulaştığında Hitler ölmüştü. Ancak ABD’nin Japonya ile savaşı halen devam ediyordu ve 6 Ağustos 1945’te sabah 8.15’te, bir B-29 bombardıman uçağı tek başına Japonya’nın Hiroşima kenti üzerinde uçarak “Little Boy”u şehrin üzerine bıraktı. Bomba43 saniye boyunca düştükten sonra şehrin yaklaşık 600 üzerinde patladı. Bir saniye sonra 274 m genişliğinde bir ateş topu oluştu ve ardından bir mantar bulutu yükseldi. Yerdeki sıcaklık saatte 1.584 km’ye çıkan rüzgârla 3.870°C’ye ulaştı. 80.000’den fazla insan bir anda buharlaşmıştı. Üç gün sonra plütonyumla çalışan “Fat Man” adlı ikinci bomba, Japonya’nın Nagasaki şehrine atıldı ve 75.000 kişinin ölümüne yol açtı. Atılan bombalar işe yaramıştı. Japonya bir ay içinde teslim oldu ve savaş kesin olarak sona erdi. Dünya artık her zamankinden daha tehlikeliydi.</p><p><b><br></b></p><p dir="ltr">Prototip olarak üretilen plütonyum bombası New Mexico’da patlatıldı, 16 Temmuz 1945</p><p><b><br></b></p><p dir="ltr">Spot</p><p dir="ltr">“BOMBA NEW MEXİCO ÇÖLÜNÜN ORTASINDA BULUNAN 30 M YÜKSEKLİĞİNDEKİ ÇELİK BİR KULEDE PATLATILDI; ORTAYA ÇIKAN PATLAMA 320 KM UZAKLIKTAN GÖRÜLEBİLİYORDU”</p><p><b><br><br></b></p><p dir="ltr">Görsel açıklamaları</p><p><b><br></b></p><p dir="ltr">Oppenheimer (ortada, solda) ve Groves (ortada) ilk bombanın atıldığı çelik kulenin kalıntılarını inceliyor</p><p><br></p><p dir="ltr">Oppenheimer, İkinci Dünya Savaşı’ndan sonra ABD’nin hidrojen bombası geliştirmesine karşı çıktı</p>',
                'large_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319323.jpg',
                'news_detail_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319323.jpg',
