            17 => 
            array (
                'id' => 32,
                'in_title' => 'Mucize sandıklarımız beynimizin gücüdür',
                'out_title' => 'Mucize sandıklarımız beynimizin gücüdür',
                'slug' => 'mucize-sandiklarimiz-beynimizin-gucudur',
                'summary' => 'Gösterisi boyunca kah zihin okuyup kah maddeye hükmederek seyirciyi hayretlere düşüren Nedim Güzel, adeta “Dünya üzerinde bir insan bir şeyi yapabiliyorsa herkeste aynı potansiyel mevcuttur” diyerek bize beynimizin gücünü hatırlatıyor.',
                'content' => '<p><em>Gösterisi boyunca kah zihin okuyup kah maddeye hükmederek seyirciyi hayretlere düşüren Nedim Güzel, adeta “Dünya üzerinde bir insan bir şeyi yapabiliyorsa herkeste aynı potansiyel mevcuttur” diyerek bize beynimizin gücünü hatırlatıyor.</em></p><p><strong>BURÇİN ÖZTINAZ</strong></p><p>Sahneye çok ciddi bir tavırla çıkıyor, seyircilerin gözlerinin içine neredeyse tek tek bakıyor. Tam bu sırada “Şu an ben fark etmeden beni etkisi altına alıyor olabilir mi?” diye düşünmeden edemiyorsunuz. Ardından sorunun yanıtının geldiği soluksuz bir gösteri başlıyor. Kaşıklar sadece bakışla bükülüyor, aklınızdan adını geçirdiğiniz ilkokul arkadaşınızın ya da bu yaz gitmek istediğiniz tatil yerinin adını pat diye söyleyiveriyor. Burada bir sihir ya da mucize değil aslında her insanda olan beyin yönetim gücünün söz konusu olduğunu söylüyor Nedim Güzel… Zaten kendini Beyin Yönetmeni olarak tanımlıyor. Kişisel gelişim alanında biraz deneyiminiz varsa sahnede izlediğiniz gösterinin bize bir şeyi hatırlatmak istediğini hissedebiliyorsunuz. Peki neyi? Biz de bu soruyu kendisine sorduk.</p><p><strong>Bedensel enerji, beyin yönetimi, hafıza… Bu konulara kişisel ilginiz nasıl başladı?</strong></p><p>Sosyoloji bölümü mezunuyum, yan dal olarak da psikoloji eğitimi aldım. Orta okuldan itibaren kişisel gelişim alanına ilgim başlamıştı. Okulda verilen kitapların dışında o yaşlardan itibaren kitapçı gezme alışkanlığı edindim ve kişisel gelişim bölümünü keşfettim. Beyin, hafıza, beden dili gibi başlıklardaki kitaplar ilgimi çekti ve okudukça ilgim daha da arttı. Hala düzenli olarak bu tür yayınları takip ederim; eğitim, seminer gördüğümde katılmaya çalışırım.</p><p>Tabii merak çok önemli ama tek başına yeterli değil. Okumanın yanında yurt içinde ve yurt dışında birçok seminere katıldım. Güzel tanışıklıklar edindim, dalında uzman isimlerle bir araya geldim. Bu şekilde beslene beslene büyüdü. Bazı konularda da yeteneğim varmış. Herkes her şeyi yapabilir, buna inanıyorum ama belki bazıları biraz daha fazla yapabilir. Bende de bazı şeyler zaman içinde ön plana çıkmaya başladı. Bu konuda kendi biriktirdiğim şeyler oldu ve bunları yavaş yavaş insanlarla paylaşmaya başladım.</p><p><strong>Paylaşımlar nasıl başladı?</strong></p><p>Kitaptan önce kişisel gelişim üzerine sohbet toplantıları şeklinde seminerler vermeye başladım ve ilgi gördü. Sonra “Neden bir kitap yazmıyorsun?” gibi sorular geldi ve ilk kitabım “4. Boyut ve Enerji”yi yazdım. O dönemde çekim yasası, insanın beynini gerçekleştirme gücü gibi konular çok ilgimi çekiyordu. Kendi deneyimlerimi ve bu konudaki teorileri toparlayarak bir kitap haline getirdim. Biraz derleme ve tecrübe arası bir kitap oldu. Sonra bunun seminerlerini yapmaya devam ettim. “Bu uygulamaları neden bir gösteri olarak sunmuyorsun?” gibi talepler olunca da interaktif bir şov başladı ve işin gösteri dünyası tarafı da büyüdü.</p><p><strong> “Beyin Yönetmeni” adlı interaktif gösterinizde zihin gücüyle kaşık büküyor, insanların çizdikleri resimleri görmeden aynısını çizebiliyor, akıllarından tuttukları isimleri ve sayıları biliyorsunuz… Bunları hepimizin yapması mümkün mü?</strong></p><p>Mümkün tabii ki. Ama bu biraz 100 metre koşmak gibi… Herkes yüz metre koşabilir mi? Bacakları sağlamsa ve teknik donanımı yeterliyse evet ama kimi 9.5 saniyede koşabilir, kimi ise 16 saniyede… Benim yaptıklarımı insanlar yapabilir mi? Belki tıpkı benim yaptığım gibi olmayabilir ama bu tip şeyler yapabilirler. Seminerler ve eğitimlerde zihin gücüyle kaşık büküyorum ama burada önemli olan kaşığın büküldüğü an değil. Anlatmak istediğim çok daha farklı… İnsan isterse zihin gücüyle her şeyi yapabilir, hatta maddeye bile hükmedebilir. Amacım bunu göstermek. Düşünmediğimiz, aklımıza gelmeyen şeyleri bile yapabiliriz. İnsanların deneyimlemesini istediğim şey bu.</p><p><strong>Gösterinizde izlediklerimiz bize ne kazandırıyor?</strong></p><p>Gösterilerimde ve seminerlerimde her zaman belli başlıklar vardır. Bir kere bazı insanların algısını yönetirim. Bunu fark etmezler aslında ama belli seçimleri yapmalarını sağlarım. Sahnede bir küçük hipnoz deneyimi yaşamalarını sağlamaya çalışırım. Hipnoz konusunda tam bir uzmanlığım yok ama bu konuda birçok eğitim aldım. Kesinlikle “Sorunlarınızı çözerim, tedavi ederim” gibi bir şey söylemiyorum. Sadece insanlara kendi bildiğimi, harmanladığımı aktarmaya çalışıyorum. Beynin gerçekleştirme gücüne en güzel örnek hipnozdur. Gösteride bundan bir kesit sunuyorum. Hafızayla ilgili yaptığım şeyler oluyor. 35 saniye civarında seyircinin karıştırdığı bir desteyi ezberlemeye çalışıyorum ve bunu biraz da görsel olarak sunuyorum. Farklı modüllerde belli örneklemeler yapıp aslında insanlara bir şeyler düşündürtmeye çalışıyorum. Bunu farkındalık yaratmak için yapıyorum. Bir küçük kapı aralamak benim için yeterli, sonrasında o kapıdan içire girip girmemek, derine inip inmemek onlara kalmış.</p><p><strong>Gösteride birinin aklından tuttuğu ismi ya da yeri bilmeniz insanları şaşırtıyor… Psişik olayları neden bu kadar dışlıyoruz?</strong></p><p>Biz aslında psişik olayları o kadar sık deneyimleriz ki artık normal gelmeye başlar ve bazılarını görmezden gelerek “tesadüf” deyip geçeriz. Uzun süredir görmediğiniz bir arkadaşınızı düşünürsünüz ve telefon çalar, sizi arıyordur. Bu aslında psişik bir deneyimdir ama biz tesadüf deriz. Psişik olaylar, iki zihin arasında iletişim kurulmasıdır aslında. Bir şey yapıyoruz ama nasıl yaptığımızı bilmiyoruz. O yüzden de tesadüf diyoruz.</p><p><strong>Son yıllarda aile dizimi gibi kuantum alan çalışmalarında aynı sistem mi devrede?</strong></p><p>Reiki, kuantum, pilates, yoga… Bana göre hepsinin özünde aynı şey var. Hepsi enerjiye dayalı. Hepsi zihin gücünün değişik uygulamaları. Büyük resmi görmek lazım. O yüzden kuantum, reiki gibi spesifik konularda soru geldiği zaman genelde büyük resme bakmayı öneriyorum. Tabii ki bunlar değerli disiplinler ama bir şeye takılıp kalmamak lazım. Bu tiyatro sanatı gibi. Tiyatronun çeşitli dalları var ve gerçekten onunla ilgilenmek istiyorsan hepsini bilmelisin, sonra birinde uzmanlaşabilirsin ama “Tiyatro sadece komedidir” demek olmaz.</p><p><strong>Hafızamızı nasıl güçlendirebiliriz?</strong></p><p>Hafıza hepimizde olan bir şey ama çoğu insan doğru kullanmayı bilmiyor. Bir dolabınız olduğunu, elinize geçen şeyleri rastgele bu dolabın içine attığınızı düşünün. Biliyorsunuz, o sandığın içinde bir şey var ama bulamıyorsunuz. Bu bilgisayarda klasör açmadan her şeyi yüklemek gibi. Doğru kaydederseniz daha kolay ulaşırsınız.</p><p><strong>Peki bilgiyi nasıl doğru depolayabiliriz?</strong></p><p>Çoğu insanın farklı yönleri kuvvetlidir. Bunları keşfetmek çok önemli. Bunun için çeşitli testler de var. Onun dışında hafızaya kodlamayla ilgili temel sistemler var. Basit bir market alışveriş listesini ezberlemenin de bir formülü var. Formüller size bu sistematiği öğretmek ve beyninizin o kasını güçlendirmek için olan şeyler. Sonrasında kişisel seçimler devreye giriyor. Bu şuna benziyor; ben size yemek listesini veriyorum, önce beraber pişiriyoruz, siz öğreniyorsunuz. Sonra “Ben tuzu biraz daha fazla koyabilirim” gibi el yordamı farklılıklar geliştiriyorsunuz. Ama temel olarak hafıza öğrenilebilen bir şey. Herkesin hafızası, kapasitesi oranında geliştirilebilir ve herkes bir şeyleri aklında tutabilir.</p><p><strong>Kitapta beynimizin ön kabulleriyle ilgili bir bölüm var. Bunu biraz açabilir miyiz?</strong></p><p>Bana göre her olay nötrdür; ne olumludur ne olumsuzdur. Biz geçmiş tecrübelerimize göre veya hayatımızdaki o anki önemine göre olumlu ya da olumsuz tarafa çekeriz. Aynı olay birisi için olumlu, bir başkası için olumsuz olabilir. Söz gelimi şu an sağanak yağmur başladı, biz “Eyvah, ıslanacağız” dedik ama şu yanda şemsiye satan birisi varsa bu onun için çok olumlu bir durum. Bu tamamen sizin nasıl anlamlandırdığınızla ve bakış açınızla ilgili.</p><p><strong>Tüm bu bilgi birikimi ve bakış açısı hayatınıza nasıl yansıyor?</strong></p><p>Hayatı pozitif yaşayan ve yaşamaya çalışan bir insanım. Tabii ki metropolde işler biraz karışık; trafik var, insanlar aceleci, saygısız… Kendimizi rahatlatmanın, biraz daha pozitif olmanın yollarını bulmalıyız. Hayat aslında basit. Kalkacağım, işe gideceğim, konsere gideceğim, eve gideceğim, kitap okuyacağım, uyuyacağım… Böyle bakınca kağıt üzerindeki senaryo çok güzel ve basit. Ama biz o senaryoyu alıp sahneye çıktığımızda stres yüklü oynamaya başlıyoruz. Stres tüm hastalıklara davetiye çıkaran, tüm organlarımızı tehdit eden, gündelik hayatımızda ilişkilerimize bile etki eden bir şey. Yoğun stres altındaki bir insanın günü güzel geçmez. O yüzden pozitif tarafa geçmekte fayda var.</p><p><em><strong>“DOĞUM DA BİR MUCİZEDİR AMA İMKANSIZ DEĞİLDİR”</strong></em></p><p><strong>Mucize nedir sizce?</strong></p><p>Mucize dendiği zaman insanlar hep şöyle cevaplar veriyorlar: “Gerçekleşmesi imkansız şeyler…” Seminerlerimde de ben soruyorum, “Mucize sizce nedir ve hayattaki en büyük mucize nedir?” diye… Genelde “Doğum” yanıtı geliyor. Bence de hayattaki en muhteşem ve mucizevi şey bir canlının içinden başka bir canlının çıkması… Ama bana göre mucize imkansızla eş değil. Doğum imkansız bir şey değil, hepimiz doğduk. Mucize çok havalı güzel bir kelime ama imkansızlık değil. Bir şeye imkansız dediğinizde o şeyi siz imkansız hale getirirsiniz.</p><p><strong>“Evren biz ne istersek isteyelim bunu gerçekleştirir” diyorsunuz kitapta… Peki isteklerde bulunurken nelere dikkat etmek gerekiyor?</strong></p><p>Evren bir fotokopi makinesidir. Bu, “Evrenden Torpilim Var” kitabının yazarı Aykut Oğut’tan duyup etkilendiğim bir kalıp. Çok güzel ifade ettiği için ben de kitabımda kullandım, ismini belirtmeyi unutmuşuz, bu vasıtayla kendisinden özür de dileyelim. Evren biz ne istersek gerçekleştiriyor ama her şeyi gerçekleştiriyor. Bir laf vardır, “Ne istediğine dikkat et, gerçekleşebilir” diye… Bu çok önemli. Beynimizin bir özelliği var, olumsuzu algılamıyor. Yani fiili algılıyor, sonundaki eki, “-malı, -meli”yi algılamıyor. Siz “İnşallah heyecanlanmam” ya da “İnşallah çantam yere düşmez” dediğiniz zaman beyin “heyecanlanmak”, “çanta yere düşmek” olarak algılıyor ve onu gerçekleştiriyor. O yüzden her zaman pozitif taleplerde bulunmalıyız evrenden ve herkesten. “Ben 100 bin lira para istiyorum evrenden ama bana vermiyor” diyenler oluyor. 100 bin lira istiyorsunuz ama bir yandan da “İnşallah işten kovulmam, inşallah kirama zam gelmez” diye de düşünüyorsunuz.</p><p>İşten kovulabiliyorsunuz, maaşınıza zam gelmediği gibi kiranıza zam gelebiliyor ve belki size 100 bin lira geliyor ama 200 bin lira gidiyor. İstemeyi ben iki gruba ayırdım: istem+emek. Bir şeyi gerçekten çok isteyeceğiz ama o yeterli değil. Evde oturalım, sabaha kadar isteyelim… Yanında emek vermemiz lazım. Her ne istiyorsak isteyelim bunun için bir emek vermemiz gerekiyor. Piyango kazanmak istiyorsak önce bilet almamız gerekir. Yan koltuğa geçmek istiyorsak önce ayağa kalkmalıyız…</p><p><strong>Neye emek vereceğimizi belirlemek, doğru hedef koymak ve hedeflere ulaşmak konusundaki düşünceleriniz neler? Her istek hedef olabilir mi?</strong></p><p>Her aklımıza gelen fikir değildir, düşüncedir. Hedef de o şekilde. Her yapmak istediğimiz hedef olamaz ve olmamalı da. Gün içinde hepimiz bir sürü şey düşünüyoruz ama aklımıza gelen her şey hedef değil, biz onu bu havuzdan sıyırıp neyi öncelik yapıyorsak hedef o oluyor aslında.</p><p><strong>Hedef belirlerken nelere dikkat etmek gerekiyor?</strong></p><p>Kariyerimizde ayrı, kişisel hayatımızda ayrı önceliklerimiz olması gerekiyor. Her şeyi anda yapamayız. Üç filmi bir anda izleyemeyiz örneğin. Bir sıraya koyup başlamamız gerekiyor ve emek vereceğimiz şeyi çok doğru şekilde istememiz gerekiyor. İstemediğimiz şeye emek vermeyiz.</p>',
