                'slug' => 'bati-avrupanin-en-yaslisi',
                'summary' => 'İspanya’da, insanın uzak akrabalarına ait, 1.1 milyon ila 1.4 milyon yaşında olduğu düşünülen bir kafatası parçası fosili bulundu. Ülkenin kuzeyinde, Burgos yakınlarındaki Sima del Elefante Mağarası’nda bulunan fosil ile Batı Avrupa’da ilk kez, ilk insanlara ait 1 milyon yaşından eski kalıntılar elde edilmiş oldu.',
                'content' => '<p>İspanya’da, insanın uzak akrabalarına ait, 1.1 milyon ila 1.4 milyon yaşında olduğu düşünülen bir kafatası parçası fosili bulundu. Ülkenin kuzeyinde, Burgos yakınlarındaki Sima del Elefante Mağarası’nda bulunan fosil ile Batı Avrupa’da ilk kez, ilk insanlara ait 1 milyon yaşından eski kalıntılar elde edilmiş oldu. 2022 yılında bulunan fosil, sol elmacık kemiğinin bir bölümünü ve üst çeneyi kapsayan, natamam durumda bir kafatası parçası. Nature dergisinde yayımlanan makalenin yazarlarından, Katalan İnsan Paleoekolojisi ve Sosyal Evrimi Enstitüsü’nden arkeolog Rosa Huguet, fosilin Homo erectus ile benzerlikler ve aynı zamanda anatomik farklılıklar taşıdığını belirtti. Homo erectus’un yaklaşık 2 milyon yıl önce ortaya çıktığı, Afrika’dan Asya ve Avrupa’ya geldiği ve son bireylerinin 100 bin yıl önce öldüğü düşünülüyor. Keşfin, erken Avrupalıların yüz hatlarının incelenmesini sağlaması ve Avrupalı ​​ataların evrimsel tarihine ışık tutması bekleniyor. Doğu Avrupa ile Asya arasındaki Gürcistan’da da insanın uzak atalarına ait 1.8 milyon yaşında fosiller bulunmuştu.</p>',
                'large_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752645862.png',
