                'id' => 34,
                'in_title' => 'Çeyrek asırlık kültür-sanat yolculuğu',
                'out_title' => 'Çeyrek asırlık kültür-sanat yolculuğu',
                'slug' => 'ceyrek-asirlik-kultur-sanat-yolculugu',
                'summary' => 'İş Sanat, çeyrek asırlık sanat yolculuğunda bir sezonu daha geride bıraktı. 25. sezon boyunca klasik müzikten caza, dünya müziğinden edebiyata uzanan dopdolu programıyla sanatseverlere unutulmaz anlar yaşattı.',
                'content' => '<p>İş Sanat, çeyrek asırlık sanat yolculuğunda bir sezonu daha geride bıraktı. 25. sezon boyunca klasik müzikten caza, dünya müziğinden edebiyata uzanan dopdolu programıyla sanatseverlere unutulmaz anlar yaşattı.</p><p>Bir önceki sezonu Placido Domingo, Murat Karahan ve Elena Stikhina’nın sahne aldığı görkemli gala konseriyle kapatan İş Sanat, bu sezonun açılışını Türkiye’nin dünyaca tanınan piyanistleri, Devlet Sanatçısı Güher ve Süher Pekinel ile yaptı. Carlo Tenan yönetimindeki Borusan İstanbul Filarmoni Orkestrası’nın eşlik ettiği konser, sezonun zengin içeriğine güçlü bir başlangıç oldu.</p><div class="code-block code-block-1"></div><p><strong>KLASİK MÜZİĞİN YILDIZLARINDAN CAZ VE DÜNYA MÜZİĞİNE</strong><br>Sezonun en özel anlarından biri, dünya opera sahnelerinin yıldız ismi Aida Garifullina’nın Türkiye’de ilk kez sahneye çıkmasıydı. Şef Rengim Gökmen yönetimindeki Bilkent Senfoni Orkestrası eşliğinde Atatürk Kültür Merkezi Türk Telekom Opera Salonu’nda gerçekleşen konser, binlerce müzikseverin ilgisiyle karşılandı. Güçlü sesi, yorum gücü ve sahnedeki karizmasıyla izleyiciyi büyüleyen Garifullina, İş Sanat tarihine adını yazdırdı.</p><p>Paganini Ödüllü kemancı Giuseppe Gibboni, Türkiye’deki ilk konserinde I Solisti di Pavia ile İtalyan bestecilerin eserlerini seslendirdi. Kontrtenor Zoltan Darago ise Les Talens Lyriques barok topluluğu eşliğinde Bach aryalarıyla izleyicilere zamanın ötesinde bir yolculuk sundu.</p><p>Son 50 yılın en yaratıcı müzisyenlerinden Hiromi, “Sonicwonder” projesiyle İstanbul’daydı. Adam O’Farrill, Hadrien Feraud ve Gene Coye ile sahne alan sanatçı, caz ve klasik müziği buluşturduğu enerjik performansıyla ayakta alkışlandı. Latin cazın önemli ismi Alfredo Rodriguez de Yarel Hernandez ve Michael Olivera ile Afro-Küba ezgilerini İstanbul’a taşıdı. Avrupa turnesine İş Sanat’ta başlayan The Tiger Lillies ise teatral performanslarıyla büyük ilgi gördü.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752645943.jpg" style="width: 737px;"></p><p><strong>ÖZGÜN İŞBİRLİKLERİNDEN PARLAYAN YILDIZLARA</strong><br>İş Sanat’ın özgün yerli projeleri bu sezon da sanatseverlerin beğenisini kazandı. Gaye Su Akyol ve kanun sanatçısı Serkan Halili’nin birlikte sahne aldığı “Endülüs’te Raks” konseri, Mor ve Ötesi’nin akustik performansı, Sevcan Orhan ve Hüseyin Turan’ın seslendirdiği sevda türküleri ile Zuhal Olcay’ın cazdan kabareye uzanan repertuvarı sezonun unutulmaz konserleri arasında yer aldı.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752645991.jpg" style="width: 738px;"></p><p>İş Sanat’ın 20 yılı aşkın süredir sürdürdüğü şiir ve hikâye dinletileri, bu sezon da beş yeni yapımla sahneye taşındı: Cahit Külebi, Adalet Ağaoğlu, Ahmet Hamdi Tanpınar, Oktay Akbal ve Aziz Nesin’in eserleri usta oyuncuların yorumuyla izleyiciyle buluştu.</p><p>İş Sanat Parlayan Yıldızlar konserlerinde bu sezonda da 20 genç müzisyene sahnesini açtı.</p><p>Hem geleceğin solistleriyle tanışmak hem de onlara destek olmak isteyen müzikseverler bu konserleri ilgiyle takip etti.</p><p>Minik izleyiciler için sahnelenen “Pat Pat Patara” adlı müzikli oyun ise ikinci sezonunda da büyük ilgi gördü. Binlerce çocuğa ulaşan yapım, antik dünyaya eğlenceli bir yolculuk sunarak kültürel mirasımızı tanıttı.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646017.jpg" style="width: 857.625px;"></p><p><strong>CUMA İŞ ÇIKIŞI KONSERLERİNDEN BLACKBOX BULUŞMALARINA</strong><br>İş Sanat’ın haftanın yorgunluğunu müzikle atmak isteyenler için ücretsiz olarak düzenlediği Cuma İş Çıkışı konserleri bu sezon da yoğun bir ilgiyle karşılandı. İş Kuleleri Kibele Çeşmesi Heykeli önündeki konserlerde Hande Yener, Nil Karaibrahimgil, Gripin, Melek Mosso, Özge Fışkın ve Burak Kut gibi Türk pop ve rock müziğinin sevilen isimleri müzikseverlerle buluştu.</p><p>Türk sanat tarihinin gelişimine ışık tutan sergileriyle sanatseverleri ağırlayan Türkiye İş Bankası Resim Heykel Müzesi’nin etkinlik mekânı BlackBox da sezon boyunca sanat tarihi, resim, opera, edebiyat, kent hafızası ve yemek kültürü gibi birbirinden farklı konularda seminerlerin ve sohbetlerin yer aldığı zengin bir program sundu.</p><p>Sezonun en özel anlarından biri, dünya opera sahnelerinin yıldız ismi Aida Garifullina’nın Türkiye’de ilk kez sahneye çıkmasıydı.</p><p>İş Sanat, Parlayan Yıldızlar konserlerinde bu sezon da 20 genç müzisyene sahnesini açtı. Türk sanat tarihinin gelişimine ışık tutan sergileriyle sanatseverleri<br>ağırlayan Türkiye İş Bankası Resim Heykel Müzesi’nin etkinlik mekânı BlackBox da sezon boyunca zengin bir program sundu.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646048.jpg" style="width: 857.625px;"></p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646054.jpg" style="width: 857.625px;"><br></p>',
