            20 => 
            array (
                'id' => 35,
                'in_title' => 'Hayatı mavi: Ülkem Gürdeniz',
                'out_title' => 'Hayatı mavi: Ülkem Gürdeniz',
                'slug' => 'hayati-mavi-ulkem-gurdeniz',
                'summary' => 'Serimizde bugüne kadar denizcilik alanında farklı mesleklerden birçok konuğumuz oldu. Hukukçusuyla, tasarımcısıyla, kaptanıyla her alanda profesyonel kadınların denizciliğe nasıl adım attıklarını ve katkı sağladıklarını öğrendik. Bu söyleşimizde de sigortacılık sektöründen üst düzey bir profesyoneli, daha önemlisi kökten denizci bir ismi ağırlıyoruz: Ülkem Gürdeniz.',
            'content' => '<p>Serimizde bugüne kadar denizcilik alanında farklı mesleklerden birçok konuğumuz oldu. Hukukçusuyla, tasarımcısıyla, kaptanıyla her alanda profesyonel kadınların denizciliğe nasıl adım attıklarını ve katkı sağladıklarını öğrendik. Bu söyleşimizde de sigortacılık sektöründen üst düzey bir profesyoneli, daha önemlisi kökten denizci bir ismi ağırlıyoruz: Ülkem Gürdeniz. </p><p><strong>Ü</strong>lkem Gürdeniz, 20 yıllık sigortacılık deneyimiyle Lockton Omni’de 2023 yılından bu yana genel müdürlük koltuğunda oturan, firmada yönetim kurulu üyesi olarak da varlık gösteren bir denizci. Dedelerinin başlattığı denizcilik geleneği, babası (benim de emrinde çalışmış olduğum) Amiral Cem Gürdeniz ile devam etmiş. Kendisi de hem mesleğiyle hem de çocuklarının adlarıyla (Bora ve Derin) geleneği devam ettiriyor. İlginç bir rastlantı, kendisi geçen ay bu sayfalara konuk olan Bilge Zaptçıoğlu Atal’ın da akrabası. Şimdi hikâyesini dinleyelim.</p><p><strong>DENİZCİ DEDELERİN TORUNU</strong></p><p>Kuşaklar boyu denizcilik geleneğine sahip çıkmış bir aileden geliyorsunuz.</p><p>Dedelerim Macit Gökırmak ve Halit Gürdeniz’in ikisi de Yüksek Denizcilik Okulu mezunu, Türk denizciliğine önemli katkılar sağlamış isimler. Biri güverte, diğeri makine bölümünde eğitim almış. Babam Emekli Amiral Cem Gürdeniz de Türk Deniz Kuvvetleri’nde uzun yıllar görev yaparak bayrağımızı onurla taşımış bir subaydır. Benim denizle tanışmam, henüz 1 yaşını doldurmamışken, babamın Sarıyer’deki sandalında aile üyelerimle birlikte yaptığımız Boğaz gezintileriyle başlamış. Deniz benim için o yıllarda sadece doğa harikası değil, yaşamımın, huzurumun ve mutluluğumun bir parçasıydı. Hem aile bağlarımızı hem de hayallerimi besleyen sonsuz bir mavilik, bizi birbirimizden ayıran ama sonunda buluşturan bir varlıktı. Hayatın dengesini ve diyalektiğini en iyi öğreten okuldu.</p><div class="code-block code-block-4 ai-viewport-1"><div class="empower-ad" data-empower-zone="156767" data-empower-id="e175264611711819965" data-empower-inited="true"><div data-id="6422b5e86c008e8f410711c9___1567671885564641" class="virgul-ad imaj" data-resource="156767@site_geneli@yachtturkiye:site_geneli" id="vrgdiv6422b5e86c008e8f410711c9"></div></div></div><p>Ve bu alanda eğitim almış, üzerine bir de kariyer yapmışsınız.</p><p>Köklü bir denizcilik geleneğine sahip bir aileden geliyor olmaktan her zaman gurur duydum. Bu ailevi mirasın ışığında üniversite eğitimimi denizcilik alanında gerçekleştirmeye karar verdim. Dokuz Eylül Üniversitesi Denizcilik Fakültesi’nden sigorta hukuku alanında çalışmalar yapan rahmetli hocamız Avukat Celal Saçaklıoğlu ile yollarımız kesişti. Kendisi sigorta hukuku üzerine bir kitap hazırlıyordu ve bana da görevler verdi. Böylece denizcilik sigortalarıyla tanıştım. Mezuniyet sonrası da rahmetli dedem Halit Gürdeniz aracılığıyla Türkiye’deki armatörler arasında sigorta konularında en bilgili isimlerden biri olan Kaptan Levent Akson ile tanıştım. O da beni deniz sigortacılığına yönlendirdi. Kısa bir süre içerisinde fark ettim ki bir kariyer değil, bir yaşam tarzı seçmiştim. Hayatımı mesleğime adadım. İlerleyen yıllarda hukuk yüksek lisansımı tamamlayarak kariyerimde ihtiyaç duyacağım hukuki bakış açısını da kazandım.</p><p><strong>YETERSİZ MARİNA SAYISI VE MÜRETTEBAT İHMALİ</strong></p><p>Ülkemizde denizcilik alanında hangi sigortalardan bahsedebiliriz? </p><p>En temel sigorta türleri arasında yer alan P&I (Koruma ve Tazmin) sigortası, deniz taşıtlarının sorumluluk risklerini kapsar. HM (Tekne ve Makine) sigortası, deniz rizikolarından kaynaklanan hasarları teminat altına alırken; WS (Harp ve Grev) sigortası savaş, grev veya benzeri risklerden kaynaklanan zararları karşılar. Yat sigortaları yatın gövdesi ile donanım ve ekipmanlarını çeşitli risklere karşı güvence altına alır. Belli bir limit çerçevesinde 3. şahıs sorumluluk teminatı da sunulabilir. Bu teminatın kapsamına alınabilen başlıca kalemler çatma/çatışma, enkaz kaldırma, çevre kirliliği, mürettebata ilişkin sorumluluklardır. Bu sigorta türü, yat sahiplerinin hem maddi kayıplarını en aza indirmeyi hem de operasyonel sürekliliği sağlamayı hedefler. Yat sigortası, bu tür durumlarda yatın faaliyetlerini devam ettirebilmesi için gereken finansal korumayı ve destek mekanizmalarını sunar.</p><div class="code-block code-block-5 ai-viewport-1"><div class="empower-ad" data-empower-zone="156779" data-empower-id="e175264611711928101" data-empower-inited="true"><div data-id="6422b5e86c008e8f410711cb___156779149465666" class="virgul-ad imaj" data-resource="156779@site_geneli@yachtturkiye:site_geneli" id="vrgdiv6422b5e86c008e8f410711cb"></div></div></div><p>Yat sigortacılığında en önemli sorunlar neler?</p><p>Denizcilik sigortalarının en karmaşık ve itina ile elleçlenmesi gereken sigorta türleri arasında. Ülkemizde marina sayısının yetersizliği ve mevcut marinaların yüksek maliyetleri nedeniyle, bu alanların dışında kışlama yapan teknelere teminat elde etmek güçleşiyor. Yeşil ekonomiye dayalı, betonun daha az kullanıldığı, doğayı azami düzeyde koruyan marina sayılarının artması yat sigortacılığına da olumlu etkide bulunacaktır. Bedelleri ciddi şekilde artan servis botlarına teminat bulmak da oldukça zor; özellikle yüksek boyutlu servis botlarının yedeklenmesi sırasında kopma/kaybolma riskleriyle karşılaşılabiliyoruz. Makine teminatı da ayrı bir konu. 2010 yılı öncesi üretilen makineler için çoğunlukla teminat sunulmazken, ahşap tekneler ve yaş almış teknelere (30 yaş üzeri) yönelik teminat bulmak oldukça zorlu bir süreç. Ayrıca, teknenin bayrağı da önemli bir faktör ve bu durum sigorta koşullarını etkileyebilir. </p><p>Mürettebatla ilgili olaylar da sık yaşanıyor değil mi?</p><p>“Mürettebat ihmali” kaynaklı olayların sıklıkla yaşandığını görüyoruz. Mürettebat temini de önemli bir ayrıntı. Sigorta konusu su aracının ehliyetsiz ve/veya kullanım için yeterli denizci ehliyetine sahip olmayan kişiler tarafından sevk ve idare edilmesi sırasında vuku bulacak ziyan, hasar, masraf ve sorumluluklar bu sigorta teminatına dahil olmayacağı poliçelerin genel klozları arasında. </p><p>Denizcilik okulları bu nedenle de çok önemli.</p><p>Tabii. Ülkemizdeki denizcilik okullarının sayısının her geçen yıl artması, sektörde nitelikli personel yetiştirilmesi açısından büyük bir avantaj sunuyor. Nitelikli personel yetiştirme kapasitesine sahip üniversitelerden mezun kişilerle yola çıkılmasını tavsiye ediyoruz. Her ülkenin ve bayrak devletinin kuralları farklı olduğundan, yatın operasyonel bölgesine ve yasal çerçevesine uygun sertifikaların ve mürettebat ehliyetlerinin sigorta poliçesi sürecinde geçerli olması sigortanın olmazsa olmazıdır. </p><p><strong>“TÜRK DENİZCLİĞİ İÇİN </strong></p><p><strong>LOKOMOTİF BİR SEKTÖR”</strong></p><p>Dünyada denizcilik alanında önemli gelişmelerin bir kısmı sigorta sektörünün çabalarıyla gerçekleşti. Sigortacılık faaliyetlerinin Türk denizciliğinin gelişmesine katkıları ile ilgili görüşleriniz neler?</p><p>Sigortacılık faaliyetlerinin Türk denizciliğinin gelişimine katkıları oldukça önemli ve derin. Bu etkilerin başında çevresel, finansal ve güvenlik alanlarındaki katkılar öne çıkıyor. Küresel denizcilik sektöründeki en büyük gelişmelerin bir kısmı, özellikle sigorta sektörünün teşviki ile gerçekleşti. Klas kuruluşlarının doğuşu buna örnek gösterilebilir çünkü sigorta şirketleri denizcilik faaliyetlerini güvence altına almak için çeşitli standartlar belirlemek zorunda kaldılar ve bu süreç denizcilik sektörünün daha güvenli ve düzenli bir hale gelmesine yol açtı. Deniz taşımacılığı ve yat sigortaları gibi alanlarda sigorta şirketlerinin sağladığı güvence ve risk yönetimi, Türk denizciliğinin uluslararası alanda rekabet gücünü artırdı. Ayrıca sigorta sektörü, Türk denizciliğine yatırım yapan yerli ve yabancı şirketlerin güven duygusunu pekiştirdi. Kısacası, sigorta yalnızca Türk denizciliği için bir finansal enstrüman olmanın ötesinde, güvenlik alanında yol gösterici rolü üstlenerek minimum standartların belirlenmesinde bir lokomotif sektör niteliğinde. Hem brokerler hem de sigortacılar, denizcilik şirketleri için birer danışman olarak önemli bir görev üstleniyor. </p><p>Yatlar için örnek verir misiniz?</p><p>Coğrafi olarak yakın mesafede bulunan ve her boyuttan teknenin sıkça uğradığı Yunan Adaları’na seyir yapan teknelerin, minimum sahip olmaları gereken poliçeler konusunda yönlendirilmesi önemli. Bu desteği sigorta şirketleri ve brokerler sağlayabilir. Öte yandan poliçe düzenleme aşamasında sigortalıya marina bilgisi sorulur. Sigortacılar, poliçelendirme aşamasında, marina seçimi konusunda sigortalıyı yönlendirebilir. Bakım ve onarım hizmetleri, doğal afetlerden korunma önlemleri, güvenlik tedbirleri gibi kriterler doğrultusunda sigortalının önerdiği marina seçimi değerlendirilir ve buna göre onay verilir. Sigortalının teknesini sigortacının onaylamadığı bir marinaya bağlamaktan kaçınacağı aşikâr.</p><p><strong>KADINLARIN SEKTÖRE ETKİLERİ VE KATKILARI</strong></p><p>Denizcilik alanında kadın olmanın getirdiği zorlukları yaşadınız mı?</p><p>Bu meslekte cinsiyetin herhangi bir avantaj ya da dezavantaj oluşturduğuna inanmıyorum. Aksine, bireyin yetkinlikleri ve fark yaratan özellikleri her zaman ön plandadır. Elbette aile kurmayı ve çocuk sahibi olmayı isteyen kadınların iş hayatında başarılı olabilmek adına iki kat daha fazla çaba harcamaları gerektiği bir gerçek. Bunun da kolay olduğunu söylemek mümkün değil. Ancak doğru planlama, sağlam bir destek ağı ve kararlılıkla bu zorlukların üstesinden gelmek mümkün. Ayrıca kadınlar bu sektöre farklı bakış açıları, empati, etkili iletişim ve problem çözme yetenekleri gibi değerli özellikler kazandırıyor. Bu da çalışma ortamını daha verimli ve kapsayıcı hale getiriyor, dolayısıyla denizcilik sektörüne genel anlamda olumlu bir ivme kazandırıyor. Kadınların sektördeki temsili arttıkça, denizcilik dünyasının daha dengeli ve yenilikçi bir yapıya kavuşacağına inanıyorum. Genç kadın arkadaşlarıma verebileceğim en önemli tavsiye, kariyerlerinde ne yapmak istediklerini iyi keşfetmeleri ve bu yolda sabırla ilerlemeleridir. Aileyi kariyer yolunu oturttuktan sonra kurmayı kadının bağımsızlığı açısından çok önemli buluyorum. </p><p>Denizcilik özel yaşamınızda ne kadar yer kaplıyor? </p><p>Yüzme ve yelken en sevdiğim sporlar arasında. Profesyonel kariyerimin yanı sıra, 7 yaşında Derin adında bir kız ve 11 yaşında Bora adında bir erkek çocuk annesi olarak, dünyanın en ağır ama bir o kadar da güzel sorumluluğu olan annelik görevimi yerine getirmeye çalışıyorum. Bu kimliği taşıdığım için kendimi çok şanslı hissediyorum. Şu sıralar hem profesyonel kariyerim hem de annelik görevlerim nedeniyle hobilerime zaman ayırmak çok mümkün olmuyor. Çocuklarımın ihtiyaçlarına, çalışan bir anne olarak zamanında yanıt verebilmek birincil önceliğim. Zamanla çocuklarım büyüdükçe ve iş hayatımda hız kesmeye başladığımda hobilerime daha çok zaman ayıracağımı umuyorum.</p><p><strong>Denizden mutluluk duymayı öğrenmek</strong></p><p>Çocuklarınızın denizle araları nasıl?</p><p>Yüzmek, yürümeyi öğrenmelerinden sonra kazandıkları en temel becerilerden biri oldu. “Derin Hanım” adlı küçük teknemizle, babamın kaptanlığında yaptığımız Boğaz seyirleri hafta sonları gerçekleştirdiğimiz en keyifli aktivitemiz. Teknede dümen tutmayı, marinadan açıldıklarında usturmaçaları toplamayı ve seyir sırasında gözcülük yapmayı öğrendiler, tüm gemi tiplerini bilen çocuklar oldular. En önemlisi de denizden mutluluk duymayı öğrendiler. İlerleyen yıllarda denizle olan bağlarının daha da güçleneceğini umut ediyorum. Ailemizdeki Thalassophile (denizi seven kişi) sayısının giderek artacağından şüphem yok.</p><p>Gelecek için planlarınızdan söz eder misiniz?</p><p>Bu yıl sektörde kariyerimde 20. yılımı tamamlıyorum. Şirket olarak amacımız Türkiye’nin denizcilik sigortacılığı alanındaki lider brokeri olarak mevcut pozisyonumuzu korumak ve denizcilik dışı branşlarda da hâkim sigorta brokerleri arasına girmek. Burada şunu belirtmek isterim: Özel hayatımda bana destek olan, başta annem ve babam olmak üzere çok değerli insanlar var. Onlardan edindiğim bu destek olmasa asla iş hayatımda bu sorumlulukların altından kalkamazdım. İyi arkadaşlar biriktirmek de çok değerli. Kadınların başarıları ve mutluluklarıyla gurur duyacak insanlarla çevrili olmaları büyük bir fark yaratıyor.☸</p>',
