            array (
                'id' => 38,
                'in_title' => 'Bilim İnsanları Dünya’ya Asteroit Çarpma Olasılığını Nasıl Hesaplıyor?',
                'out_title' => 'Bilim İnsanları Dünya’ya Asteroit Çarpma Olasılığını Nasıl Hesaplıyor?',
                'slug' => 'bilim-insanlari-dunyaya-asteroit-carpma-olasiligini-nasil-hesapliyor',
                'summary' => '2024 YR4’ün Dünya’ya çarpma ihtimali yüzde 3,8 kadar yükseldi.',
                'content' => '<p><strong>2024 YR4’ün Dünya’ya çarpma ihtimali yüzde 3,8 kadar yükseldi.</strong></p><p><em>Bu makale aslen <a href="https://theconversation.com/how-do-scientists-calculate-the-probability-that-an-asteroid-could-hit-earth-249834" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">The Conversation</a>‘da yayımlandı.</em></p><p>Bu yılın Ocak ayında, <a href="https://science.nasa.gov/blogs/planetary-defense/2025/01/29/nasa-shares-observations-of-recently-identified-near-earth-asteroid/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">2024 YR4 isimli bir asteroitle alakalı bir bildirim</a> aldığımda sabahki dersime hazırlanıyordum. Dünya’ya çarpma olasılığının olağan dışı derecede yüksek olduğunu söylüyordu.</p><div class="td-a-rec td-a-rec-id-content_inline  tdi_50 td_block_template_1"><div class="empower-ad" data-empower-zone="157117" data-empower-id="e17526467152155085" data-empower-inited="true"><div data-id="6422b6056c008e8f41071247___157117547968083" class="virgul-ad imaj" data-resource="157117@site_geneli@popsci_tr:site_geneli" id="vrgdiv6422b6056c008e8f41071247"></div></div></div><p>Dünya’yı asteroitler gibi davetsiz misafirlerden korumak <a href="https://scholar.google.com/citations?user=8_qb8h8AAAAJ&hl=en" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">uzmanlığımın bir parçası olduğundan</a>, öğrencilerim ve meslektaşlarım hemen neler olduğuyla alakalı sorular sormaya başladılar.</p><p>Bilim insanları bir asteroidin yörüngesi sebebiyle Dünya’ya yaklaşabileceğini belirlediklerinde, onu sık sık takip ediyor ve gezegenimizle çarpışabilme olasılığını hesaplıyorlar. Daha fazla gözlem verisi elde ettikçe, neler olabileceğine yönelik daha iyi bir tabloya ulaşıyorlar.</p><p>Erkenden daha çok veri noktasının olması, bilim insanlarının tahminlerini daha iyi yapmıyor. Asteroit uzayda giderken yörüngesini daha iyi anlamak için onu takip etmeleri gerekiyor.</p><p>Bu olayı birkaç ay sonra düşünürken, bilim insanlarının söz konusu tehlikeden halkı haberdar etmeleri için daha iyi bir yöntemleri olup olmadığını merak etmiştim. Doğru bilgilerimiz var ama duyduğum soruların gösterdiği üzere bunun aslında ne anlama geldiğini anlamak için her zaman yeterli olmuyorlar.</p><p><strong>Sayılar her gün değişiyor</strong></p><p>2024 YR24 asteroidinin <a href="https://blogs.nasa.gov/webb/2025/04/02/nasas-webb-finds-asteroid-2024-yr4-is-building-sized/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">yaklaşık 60 metrelik çapı</a> var; hemen hemen 15 katlı bir binanın uzunluğuna eşdeğer.</p><p>Ocak’ta duyuru yapıldığı zaman, asteroidin çarpışma olasılığının <a href="https://science.nasa.gov/blogs/planetary-defense/2025/01/29/nasa-shares-observations-of-recently-identified-near-earth-asteroid/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">%1’i aştığı</a> aktarılmıştı. Bu çarpışma olasılığı, tehlikeli bir asteroidin Dünya’ya çarpmasının ne kadar muhtemel olduğunu gösteriyor. Örneğin çarpışma olasılığı %1 ise, 100 vakadan 1’inde Dünya’ya çarptığı anlamına geliyor. 100’de bir nadir sayılır ama Dünya’yı mahvedebilecek bir çarpışma ihtimalinden bahsediyorsanız tehlikeli olabilecek kadar yakın.</p><p>Fakat zamanla yapılan daha fazla gözlem ve analiz, bu asteroidin Dünya ile çarpışma ihtimalinin neredeyse sıfır olduğunu ortaya çıkardı.</p><p></p><figure id="attachment_50652" aria-describedby="caption-attachment-50652" class="wp-caption alignnone"></figure><p></p><p>Ocak ayındaki ilk bildirimden sonra, çarpışma olasılığı <a href="https://science.nasa.gov/blogs/planetary-defense/2025/02/19/dark-skies-bring-new-observations-of-asteroid-2024-yr4-lower-impact-probability/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">18 Şubat</a>‘ta sürekli olarak %3,1’e yükseldi fakat <a href="https://science.nasa.gov/blogs/planetary-defense/2025/02/19/dark-skies-bring-new-observations-of-asteroid-2024-yr4-lower-impact-probability/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">19 Şubat</a>‘ta %1,5’a düştü. Ardından, çarpışma olasılığı <a href="https://science.nasa.gov/blogs/planetary-defense/2025/02/24/latest-calculations-conclude-asteroid-2024-yr4-now-poses-no-significant-threat-to-earth-in-2032-and-beyond/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">24 Şubat</a>‘ta %0,004’e varana dek düşmeye devam etti. <a href="https://cneos.jpl.nasa.gov/sentry/details.html#?des=2024%20YR4" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">15 Haziran itibarıyla</a> artık %0,0000081’den daha düşük bir çarpışma olasılığına sahip.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646794.jpeg" style="width: 857.625px;"></p><p>Ancak Dünya’ya çarpma ihtimali geçse de; asteroidin Ay’a çarpma olasılığı artmaya başladı. <a href="https://science.nasa.gov/blogs/planetary-defense/2025/02/24/latest-calculations-conclude-asteroid-2024-yr4-now-poses-no-significant-threat-to-earth-in-2032-and-beyond/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">24 Şubat</a>‘ta %1,7’ye kadar çıkarken, 2 Nisan’da <a href="https://science.nasa.gov/blogs/planetary-defense/2025/04/02/nasa-update-on-the-size-estimate-and-lunar-impact-probability-of-asteroid-2024-yr4/" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">%3,8</a>‘di.</p><p>Ay’a çarparsa, bu çarpışmadan fırlayan maddelerden bazıları Dünya’ya ulaşabilir. Fakat bu maddeler Dünya’nın kalın atmosferine girdiklerinde yanıp kül olur.</p><p><strong>Çarpışma olasılığı</strong></p><p>Araştırmacıların yaklaşan bir cismin Dünya’ya çarpıp çarpmayacağını görmek için araştırmacıların astrometri şeklinde adlandırılan bir yöntem ile asteroidin yörüngesinin nasıl göründüğünü bulması gerekiyor. Bu yöntemle bir cismin yörüngesi sadece birkaç kilometrelik belirsizliğe kadar isabetli şekilde belirlenebiliyor. Fakat astrometri için uzun bir süre boyunca alınmış doğru gözlem verileri gerekiyor.</p><p>Cismin yörünge hesaplamasında meydana gelen herhangi bir belirsizlik, tahmin edilen çözümde değişkenliklere sebep oluyor. Tek ve kesin bir yörünge yerine, hesaplama genelde muhtemel yörüngelerden oluşan bir olasılık bulutu sunuyor bilim insanlarına. Bu konumları çevreleyen elipse bir hata elipsi adı veriliyor.</p><p><a href="https://doi.org/10.1016/j.icarus.2015.05.032" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">Çarpışma olasılığı</a>, bu elipsteki kaç yörünge tahmininin Dünya’ya çarptığını belirtiyor.</p><p>Yeterli gözlem verisi olmadan, yörünge belirsizliği yüksek oluyor ve elips geniş olma eğilimi sergiliyor. Geniş bir elipste, bu elipsin “kazara” Dünya’yı da içerme ihtimali daha yüksek; merkez gezegenden uzakta olsa bile. Bu yüzden bir asteroid nihayetinde Dünya’ya çarpmayacak olsa bile; hata elipsi bilim insanları yeterli veri toplayıp belirsizliği daraltmadan önce <a href="https://doi.org/10.1016/j.icarus.2015.05.032" data-wpel-link="external" target="_blank" rel="external noopener noreferrer">gezegeni de</a> içine alabilir.</p><p></p><figure id="attachment_50653" aria-describedby="caption-attachment-50653" class="wp-caption alignnone"></figure><p></p><p>Belirsizlik seviyesi düştüğünde elips daralıyor. Bu yüzden Dünya ufak bir hata elipsinin içerisinde olduğunda, büyük bir hata elipsinin içerisinde olduğu zamana kıyasla çarpışma etkisi yükselebilir. Hata elipsi artık Dünya’yı içine almayacak kadar daraldığında, çarpışma olasılığı önemli miktarda azalıyor. 2024 YR4’te de böyle oldu.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646869.png" style="width: 857.625px;"></p><p>Çarpışma olasılığı, çarpışma tehlikesine dair anlamlı bir fikir sunan tek ve kullanışlı bir değer. Fakat herhangi bir bağlam olmaksızın sadece çarpışma olasılığının kullanılması, 2024 YR4’te gördüğümüz üzere halka anlamlı bir rehber sağlamayabilir.</p><p>Kafa karışıklığı ve korku yaratmadan önce insanlara gelecekteki tehditlere dair daha iyi bilgi vermenin alternatif yolları, daha fazla veri gelmesini bekleyerek çarpışma tahminini iyileştirmek ya da Dünya’daki çarpışmaları değerlendirmek için yeni ölçüm yöntemleri sunmak.</p><div><br></div>',
