                'id' => 39,
                'in_title' => 'TÜRKİYE’NİN HAVA KİRLİLİĞİ KARNESİ GRİ YORGUNLUK',
                'out_title' => 'TÜRKİYE’NİN HAVA KİRLİLİĞİ KARNESİ GRİ YORGUNLUK',
                'slug' => 'turkiyenin-hava-kirliligi-karnesi-gri-yorgunluk',
                'summary' => 'Fosil yakıtların kullanımı ve diğer insan kaynaklı etkiler havayı gözle görülmeyen partiküllerle doldururken sağlıktan toprağın yapısına birçok alanda ağır sonuçlar doğuruyor. Atlas, hava kirliliği sorununu ele alan Kara Rapor 2024’ü inceledi, sorunun nedenleri ve çözüm yollarıyla ilgili olarak uzmanlarla görüştü.',
            'content' => '<p><b>Fosil yakıtların kullanımı ve diğer insan kaynaklı etkiler havayı gözle görülmeyen partiküllerle doldururken sağlıktan toprağın yapısına birçok alanda ağır sonuçlar doğuruyor. Atlas, hava kirliliği sorununu ele alan Kara Rapor 2024’ü inceledi, sorunun nedenleri ve çözüm yollarıyla ilgili olarak uzmanlarla görüştü.</b></p><p><b>YAZI: MUSTAFA TÜRKER ERŞEN</b></p><p>Çevreyi seyretmeye uygun önü geniş ve açık bir yerden, özellikle de yüksekçe bir noktadan yaşadığımız kente baktığımızda bazen çatılara doğru alçalan farklı bir ton, havada asılı kalmış geniş ve saydam bir kütle fark ederiz. Belki sadece pus. Belki de bacalardan, egzozlardan çıkan dumanın oluşturduğu ve rüzgârın dağıtmayı başaramadığı bir birikinti, havadaki gri bir yorgunluk… Bu ikisini birbirinden ayırmak özellikle büyük kentlerde yaşayanlar için her zaman kolay olmayabilir. Hava kirliliği çoğu zaman biz farkına bile varmadan, varsak bile hemen çözemeyeceğimiz ve kaçamayacağımız bir şekilde bizi sarıverir, sokaklarımızda dolaşıp evimize girer, içimize dolar. Soluduğumuz havaya bile güvenememek, doğayla sürekli zıtlaşan modern sanayi çağının bize verdiği “hediye”lerden biri. Doğadaki yeni ve gri bir yorgunluk… </p><p>Çevre, Şehircilik ve İklim Değişikliği Bakanlığı Ulusal Hava Kalitesi İzleme Ağı verilerine göre, 2023 yılında Türkiye nüfusunun en az yüzde 92’si Dünya Sağlık Örgütü (DSÖ) standartlarına göre kirli hava soludu. Türkiye’de 2022 yılında 30 yaş üstü toplam 480 bin 991 ölümün yüzde 14.2’si hava kirliliğine atfediliyor (kazalar, yaralanmalar ve Covid-19 nedenli ölümler dışında). Daha da kötüsü, hava kirliliğine bağlı olduğu düşünülen ölümler hem sayısal hem oransal olarak artıyor. DSÖ kılvavuz değerine göre 2022’de 30 yaş üstü için hava kirliliğine atfedilen ölüm sayısı İstanbul’da 8 bin 357, İzmir’de 4 bin 852 ve Bursa’da 3 bin 657. İl nüfusuna oranı açısındansa Hakkâri 230 ölüm ve yüzde 41’lik payla ilk sırada yer alıyor. </p><div><div class="penci-custom-html-inside-content"><div class="empower-ad" data-empower-zone="155962" data-empower-inited="true"></div></div></div><p>Temiz Hava Hakkı Platformu, Eylül ayında Kara Rapor 2024’ü kamuoyuyla paylaştı. Platformda Türk Nöroloji Derneği, Doğal Hayatı Koruma Vakfı, Türk Tabipleri Birliği, Greenpeace Akdeniz gibi sağlık, doğa koruma ve iklim alanlarında çalışan 15 sivil toplum kuruluşu ve meslek örgütü bir araya geliyor. Kara Rapor 2024, Türkiye’de yaşayan bir insanın, Dünya Sağlık Örgütü’nün belirlediği kılavuz değerin yaklaşık beş katı hava kirliliğine maruz kaldığına dikkat çekiyor. İnsan faaliyetlerinden kaynaklanan hava kirliliğinin başlıca nedenlerinden biri ise fosil yakıtların, yani kömür, petrol ve doğalgazın yakılması.</p><p>Türkiye’de fosil yakıtlar enerji üretiminde yüzde 82.8’lik paya sahip. Kimi ülkeler, küresel iklim değişikliğini dizginlemeyi amaçlayan 2015 tarihli Paris İklim Anlaşması’ndan sonra özellikle kömür kullanımını azaltmak için radikal adımlar atmaya başladı. Türkiye’deyse bu konuda şimdilik bir hareketlenme yok. Türkiye, küresel ölçekte hâlâ önemli bir kömür üreticisi ve bu konuda dünyada 11’inci sırada bulunuyor. 1980’den 2021’e kadar Türkiye’de toplam kömür üretimi 4.5 katına çıktı. Yani Paris İklim Anlaşması’nı imzaladıktan sonra bile 2021’e kadar Türkiye toplam kömür üretimini 1.5 kata yakın artırdı.</p><p>Kara Rapor 2024’ün öne çıkan noktalarını sorduğumuz, raporun editörü ve yazarlarından çevre mühendisi ve iklim uzmanı Deniz Gümüşel, Atlas’a yaptığı değerlendirmede Türkiye’nin  yüksek oranda fosil yakıtlara bağımlı olmasına rağmen yenilenebilir enerji potansiyelini hatırlatıyor: “Türkiye’de, son verilerin açıklandığı 2022 yılında tüketilen 79 milyon ton linyitin yüzde 83.5’i termik santrallerde elektrik üretimi için kullanıldı; 35.1 milyon ton taşkömürünün yüzde 60’ını termik santraller, yüzde 18’ini de demir-çelik sanayi kullandı. Bu miktarda kömür tüketimi ciddi hava kirliliğine yol açıyor. Çoğu eski termik santralin, verimli çalışan baca gazı arıtma tesisi hâlâ bulunmuyor. Oysa Türkiye yüksek yenilenebilir enerji potansiyeliyle kömüre bağımlılığını ortadan kaldırabilir.”</p>',
