                'id' => 40,
                'in_title' => 'Evin büyüklerine teknoloji öğretme zamanı',
                'out_title' => 'Evin büyüklerine teknoloji öğretme zamanı',
                'slug' => 'evin-buyuklerine-teknoloji-ogretme-zamani',
                'summary' => 'Evlerimizi modern teknolojiyle uyumlu şekilde döşüyor ve yaşam alanlarımıza her gün daha fazla teknoloji sokuyoruz. Ancak bizimle beraber yaşayan ve artık yaşları ilerleyen büyüklerimize de bu teknolojileri nasıl kullanabileceklerini öğretiyor muyuz?',
                'content' => '<p>Evlerimizi modern teknolojiyle uyumlu şekilde döşüyor ve yaşam alanlarımıza her gün daha fazla teknoloji sokuyoruz. Ancak bizimle beraber yaşayan ve artık yaşları ilerleyen büyüklerimize de bu teknolojileri nasıl kullanabileceklerini öğretiyor muyuz? Çünkü hayatımıza, günlük yaşam rutinimize kattığımız her yeni teknoloji, onu kullanmayı bilmeyen büyüklerimizi biraz daha esarete ve çaresizliğe sürüklemek demektir. Çocukları, torunları olmadan dünyada ayakta kalamayacak, telefon açamayacak, yardım isteyemeyecek, sipariş vermeyecek, dışarı dahi çıkarken tedirgin olacak yaşlılar yaratmak yerine onlara çok basit şekilde teknolojiyi öğreterek, yaşamlarını çok daha mutlu ve huzurlu şekilde geçirmelerine destek olabiliriz. İşte, evdeki büyüklerimize, teknololojiyi öğretmenin püf noktaları.</p><p><strong>1. Teknolojiyi sadeleştirerek anlatın</strong></p><p>Evdeki yaşlılarımızın teknolojiyi bizim gibi algılamasını beklemek büyük bir hata olur. Onların doğduğu, büyüdüğü, kendilerini tanımladığı dünyada internet, Twitter, Intagram, WhatsApp, Selfie, ‘kanalıma hoş geldiniz Youtuber’ı veya IP numarası, 4.5G, sosyal medya, megapiksel, troll gibi kavramlar yoktu. Dolayısıyla bu kavramları ilk duydukları anda anlamalarını beklemek büyük hayalcilik olmaz mı? Peki, onlara tamamen yabancı oldukları bu kavramları nasıl kolayca anlatabiliriz? İşte burada, insanoğlu canlısının en kolay öğrenme mekanizmasını kullanmanızı tavsiye ediyoruz. Çizerek öğretin. Evet, bu kadar basit. Çizin. Nasıl mı çizeceksiniz? Örneğin, internetin ne olduğunu anlatırken, bir dünya görseli çizin. Sonra bu dünyaya bağlanan çok sayıda cep telefonu çizin. Böylece telefonlar üzerinden herkesin ortak bir bilgi havuzuna bağlandığı bilgisini görselleştirerek anlatmış olacaksınız. Telefonlar artık yaşlı ninezin aklında, dünyaya bağlanan minik bir bilgi penceresi olarak yer edecektir. Nineniz telefona her baktığında, onu minik bir pencere olarak hatırlayacaktır. Ardından da o cihazın internete nasıl bağlandığına dair daha teknik detaylara geçebilirsiniz. Ama tabi teknik detayları çok da detaylandırıp göz korkutmayın. Karşınızda bir mühendis yok. Öncelikle yabancı kavramların kolayca anlaşılabilmesini sağlayın ki, bilmedikleri konular hakkındaki korkuları geçsin. Sizin için çok olağan bir isim ve kavram olan Google, Apple, <a href="https://www.hepsiburada.com/iphone-ios-telefonlar-c-60005202"><strong>iPhone</strong></a> veya diğer <a href="https://www.hepsiburada.com/cep-telefonlari-c-371965"><strong>cep telefonları </strong></a>ya da örneğin <a href="https://www.hepsiburada.com/bluetooth-kulakliklar-c-16218"><strong>Bluetooth kulaklık</strong></a> 80 yaşındaki babaneniz için tamamen anlamsız, yabancı, anlaşılması zor bir kavramdır, unutmayın.</p><p><strong>2. Bıkmadan ve şefkatle alıştırma yapın</strong></p><p><span id="more-2748"></span></p><p>Mobil uygulamaları, internet tarayıcılarını, web sitelerini anlatırken yaşlılarımızın bu uygulamaları bir anda kullanmaya başlamalarını, bir anda öğrenmelerini beklemeyin. Her adımda küçük küçük alıştırmalar yaparak onları bir sonraki adıma hazırlayın. Örneğin, WhatsApp kullanmaya başlamadan önce dokunmatik ekranlarda tek tıklama, uzun tıklama, çift tıklama gibi detayların farkını anlatın. Mobil dokunmatik klavyeyi açmayı, kapamayı gösterin. Klavye üzerinde uzun uzun metinler yazarak alışkanlık kazanmalarını sağlayın. Ardından da birbirinizle uzun uzun mesajlaşın. Fotoğraf, video göndermeyi deneyin. Bir sonraki aşamada, tarayıcıyı anlatın. URL’nin ne demek olduğunu, nasıl çalıştığını sabırla anlatın. Birbirinize link göndererek alıştırmalar yapın. Alıştırma yapmaktan çekinmeyin, yorulmayın. Bu aşama onların teknolojiyi öğrenmesi için çok önemli. Siz okuma yazmayı öğrenirken, matematiği anlamaya çalışırken anne babalarınızın, dedelerinizin sizin başınızda saatlerce durduğunu, sizinle birlikte “Ali topu at, tut Ali tut,” gibi akla zarar cümleleri saatlerce tekrar etmek gibi işkencelere hiç şikayet etmeden katlandığını unutmayın. Sahip olduğunuz bilgiyi, yetenekleri, eğitimi onlara borçlusunuz. Şimdi borcunuzu ödeme zamanı geldi.</p><p><strong>3. Son teknoloji ürünleri kullandırın</strong></p><p>Anne babalara, dedelere, ananelere, babanelere teknolojik cihazlar alırken genellikle eski model cihazlar tercih edilir. Oysa bu büyük bir hata olur. Yaşlılarınızın eline eskimiş teknolojileri verdiğinizde, onların modern teknolojilere alışmasını bekleyemezsiniz. Ekranı zar zor çalışan, dokunmatik ekranı hızlı tepki vermeyen, videoları doğru düzgün oynatamayan, çalışırken sık sık takılan bir cihaz yaşlılarımızın teknolojiden sıkılmasına neden olur. “Bununla mı uğraşacağım,” diye düşünmesine sebep olur. Emin olun, elinde iPhone 11 Pro olan bir dede, kendini kısa sürede geliştirip sizden daha fazla takipçiye sahip bir sosyal medya fenomenine dönüşebilir.</p><p><strong>4. Özel günler ayırın</strong></p><p>Teknoloji kullanımını öğrenmeleri için onları hayatın doğal akışına bırakırsanız, bazı kilit teknolojileri öğrenmeleri hiç mümkün bile olmayabilir. Bu da genellikle tüm dünya bir teknolojiyi öğrenip eskittikten ve artık kullanmayı bıraktıktan sonra gerçekleşir. Onları güncel teknolojilerle ve uygulamalarla tanıştırmak için, bazı özel günler ayırın. Örneğin, Spotify’ı kullanarak müzik dinlemeye alışmaları için evde bir Spotify günü ilan edin. Annenizin telefonuna bir hoparlör bağlayıp sevdikleri müzikleri nasıl bulacağını ve çalacağını gösterin. Liste yapmasını, şarkıları değiştirmesini, yeni şarkılar aramasını öğretin. Ardından da gün içinde ara ara istek şarkılarda bulunun. Hatta bu isteklerinizi WhatsApp’tan gönderin. Annenin, babanız, dedeniz, ananeniz, babaneniz o gün evin DJ’i olsun. Ertesi gün Spotify ile hayatına renk katan, müzik katan, mutluluktan evde dans eden büyüklerinizi görmek hiç şaşırtıcı olmayacak. Biraz düşünün bakalım, başka uygulamalar için nasıl özel etkinlikler düzenleyebilirsiniz… Instagram’da paylaşım çılgınlığını anlayıp öğrenmeleri için özel bir gezi düzenlemek… YouTube’u anlayıp kullanmaya alışmaları için mutfakta bir yemek tarifleri keşif günü tertip etmek… Hayal gücünüzü çalıştırın. Yaşlılarınızı hayattan koparmayın, onları hayata bağlayın.</p><p><br></p>',
