                'slug' => 'paris-moda-haftasi-hermes-ilkbaharyaz-2026-erkek-koleksiyonu-1',
                'summary' => 'Hermès, Paris Moda Haftası’nda İlkbahar/Yaz 2026 erkek koleksiyonunu tanıttı. Kreatif direktör Véronique Nichanian’ın hazırladığı koleksiyon, “Şehirde Yaz” temasıyla sade ama şık bir yaz gardırobu sunuyor. Nefes alabilen kumaşlar, yumuşak renkler ve dökümlü kesimler öne çıkıyor. Koleksiyonun ana tonları arasında toprak rengi ve ara ara kullanılan yeşil dikkat çekiyor. Kıyafetler, bedeni sararken aynı zamanda hareket özgürlüğü sağlıyor. Bazı parçalar daha yapılandırılmış bir duruşa sahipken, bazıları ise daha rahat ve akışkan formlarla tasarlanmış. Bu da koleksiyona dengeli ve modern bir görünüm kazandırıyor.',
                'content' => '<p><p></p><div class="abg245"><div id="web_elle_tr_icerik_banner_1" data-empower-zone="155481" class="empower-ad hide-mobile" data-empower-id="e175264502086511827" data-empower-inited="true"></div></div></p><p>Hermès, Paris Moda Haftası’nda İlkbahar/Yaz 2026 erkek koleksiyonunu tanıttı. Kreatif direktör Véronique Nichanian’ın hazırladığı koleksiyon, “Şehirde Yaz” temasıyla sade ama şık bir yaz gardırobu sunuyor. Nefes alabilen kumaşlar, yumuşak renkler ve dökümlü kesimler öne çıkıyor. Koleksiyonun ana tonları arasında toprak rengi ve ara ara kullanılan yeşil dikkat çekiyor. Kıyafetler, bedeni sararken aynı zamanda hareket özgürlüğü sağlıyor. Bazı parçalar daha yapılandırılmış bir duruşa sahipken, bazıları ise daha rahat ve akışkan formlarla tasarlanmış. Bu da koleksiyona dengeli ve modern bir görünüm kazandırıyor.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752645097.jpeg" style="width: 480px;"></p><p>Hermès, bu koleksiyonla yaz aylarında şehir hayatı için ideal, zamansız ve kullanışlı bir stil öneriyor. Gösterişten uzak ama her detayıyla özenli bir tasarım anlayışı sunuyor.</p>',
