            28 => 
            array (
                'id' => 44,
                'in_title' => '125 Günde Devri Alem',
                'out_title' => '125 Günde Devri Alem',
                'slug' => '125-gunde-devri-alem-1',
                'summary' => 'Ferdinand Macellan’ın macera dolu, kimi zaman talihsiz, kanlı ve acımasız yolculuğu

Yazan: Jonathan Gordon',
            'content' => '<p dir="ltr">10 Ağustos 1519’da, Armada de Molucca adı verilen beş gemilik filo ve 270 denizci, batı yönünde ilerleyerek Endonezya’nın doğusundaki Baharat Adaları’na (bugünkü adıyla Maluku Adaları) ulaşan ve böylece geleneksel “doğu rotası”nın yerini alabilecek bir “batı rotası” keşfetmek için Sevilla’dan yola çıktı. 8 Eylül 1522’de Sevilla’ya döndüklerinde, filodan geriye kalan tek gemi ve 18 adam tarihte ilk kez dünyanın çevresini dolaşmayı başarmıştı. Yolculuğun bedeli çok ağır olmuştu ancak aslına bakılırsa geriye dönebilmiş olmaları bile bir mucizeydi. Portekizli kâşif Ferdinand Macellan’ın liderliğinde başlayan bu keşif yolculuğu, yıllar içinde pek çok isyan, savaş ve hastalık atlattı. Sonunda filo kaptanlığı Bask denizci Juan Sebastián Elcano’ya geçti ve dünya turu tamamlanmış oldu. Macellan ise çoktan ölmüştü. Şimdi gelin bu destansı keşif seferini adım adım inceleyelim ve hem filonun kendi içinde hem de yol boyunca karşılaşılan yerli halklarla mürettebat arasında yaşanan, çoğu zaman kanlı ve acımasız olaylara bir göz atalım.</p><p><b id="docs-internal-guid-f71641a6-7fff-dd51-fa88-7691d148fc9e"><br></b></p><p dir="ltr"><b>Süper Güçlerin Çatısması</b></p><p dir="ltr"><b>Tarih</b>: 10 Ağustos 1519 – 20 Eylül 1519</p><p dir="ltr"><b>Konum</b>: Sevilla ve Sanlúcar de Barrameda (İspanya)</p><p dir="ltr">Ferdinand Macellan uzun zamandır Yeni Dünya üzerinden Atlantik Okyanusu’nu Büyük Okyanus’a (Pasifik Okyanusu) bağlayan bir geçit arıyordu. Daha önce Endonezya’da yaptığı keşif seferleri ve fetihlerle adını duyuran usta denizci, Afrika’nın güneyindeki tehlikeli Ümit Burnu’nu dolaşmadan doğuya ulaşmanın mümkün olduğuna inanıyordu. Ancak Portekiz Kralı I. Manuel’i bu fikre ikna edemedi. Üstelik kralın gözünden de düşmüştü. Çaresiz kalan Macellan, rotasını ülkesi Portekiz’in en büyük rakibi İspanya’ya çevirdi.</p><p dir="ltr">Tahta yeni çıkmış olan İspanya Kralı I. Charles (yakında Kutsal Roma İmparatoru olarak Şarlken ismiyle anılacaktı), Macellan’ın teklifini büyük bir hevesle kabul etti. Charles, Tordesillas Antlaşması gereği Portekizlilerin kontrolündeki “doğu rotası”na alternatif olabilecek başka bir güzergâh üzerinden Baharat Adaları’na ulaşmak istiyordu. Bu sayede kraliyet kasasını dolduracak ve henüz ilk yıllarında adını tarihe altın harflerle yazdıracaktı. Böylece Portekizli denizci, doğduğu topraklara sırtını dönerek İspanya Kralı’na sadakat yemini etti. Kral’a, doğudan baharat ve zenginlik getirme ve yol boyunca İspanya lehine ittifaklar kurarak krallığın nüfuzunu artırma sözü vermişti. İspanyol keşiflerinin ayrıntılı kayıt tutma geleneği ve sefere katılan İtalyan âlim ve vakanüvis Antonio Pigafetta’nın kaleme aldığı notlar sayesinde, bugün bu destansı yolculukta yaşananlara dair tüm detayları biliyoruz. Sefer için Sevilla’da dördü karak, biri ise karavel tipi olmak üzere beş gemi inşa edildi. Bu filo, Büyük Okyanus’a açılan bir geçit ve oradan da Baharat Adaları’na uzanan bir rota bulmak üzere batıya doğru yelken açacaktı. Sevilla’dan nehir boyunca Sanlúcar’a doğru ilerlediler ve burada stok yapıp yola koyuldular; tıpkı Macellan’ın kahramanı Kristof Kolomb’un 20 yıl öncesinde Yeni Dünya’ya gerçekleştirdiği üçüncü yolculukta yaptığı gibi…</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752317216.jpg" style="width: 499px;"><b><br></b></p><p dir="ltr"><b>Kötü Bir Baslangıç</b></p><p dir="ltr"><b>Tarih</b>: 26 Eylül 1519</p><p dir="ltr"><b>Konum</b>: Kanarya Adaları</p><p dir="ltr">İspanya dışına yapılan tüm keşif seferlerini denetleyen kurum Casa de Contratación (Ticaret Evi), Portekizli Macellan’a güvenmiyordu. Bu yüzden mürettebatın içine kendi adamlarını yerleştirdiler. Aralarında kurumun başkanının gayrimeşru oğlu Juan de Cartagena da vardı ve daha yolculuğun başlarında isyan söylentilerinin odağında yer almaya başladı. Bu sırada, Portekiz Kralı I. Manuel’in, Macellan’ı yakalamak ve tutuklamak üzere peşinden bir filo gönderdiği haberi ulaştı. Yolculuğun ilk aylarında Macellan, bir yandan İspanyol mürettebatın isyan ihtimalinin, diğer yandan ise Portekiz kralının intikam tehdidinin gölgesinde seyrediyordu. Bu da yetmezmiş gibi, mürettebatla arasını açan bir olay yaşandı: Geminin lostromosu, yani baş tayfası Antonio Salamon, kamarotlardan Antonio Ginovés ile eşcinsel ilişkiye girmiş ve Macellan’ın emriyle yargılanıp, boğularak idama mahkûm edilmişti. O dönemde bu durum yasadışıydı ama denizlerde yaygın görülen ve genellikle görmezden gelinen bir konuydu. Bu sert cezanın ardından yapılan bir toplantıda Cartagena, Macellan’ın izlediği rotayı açıkça sorguladı. Üstelik bundan böyle onun emirlerine uymayacağını da ilan etti. Ne var ki yandaşları Cartagena’ya destek vermekte tereddüt edince, Macellan hızla harekete geçti ve onu görevden alıp tutuklattı. İsyan ateşi şimdilik söndürülmüştü ama filoda gerilim artıyordu.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr"><b>Geçidin Pesinde</b></p><p dir="ltr"><b>Tarih</b>: 13 Aralık 1519 – 31 Mart 1520</p><p dir="ltr"><b>Konum</b>: Rio de Janeiro Körfezi (Brezilya), Puerto San Julián (Arjantin)</p><p dir="ltr">Nihayet batıya yönelerek Afrika kıyılarından iyice uzaklaşan filo, Atlantik’i aşıp, Kasım ayının sonlarına doğru Güney Amerika kıyılarına ulaştı. Macellan, güneye doğru ilerleyerek, Büyük Okyanus’a açılan bir geçit bulabileceklerine inanıyordu. Rio de Janeiro’daki Santa Lucia Körfezi’ne vardıklarında, Guarani yerlileri tarafından dostane bir şekilde karşılandılar. Kral I. Charles, yerli halkla temas konusunda çok net talimatlar vermişti. Öncelikle, mürettebatın yerli kadınlarla cinsel ilişkiye girmesi yasaktı. Ayrıca, kesinlikle silah kullanılmayacaktı ve yerlilere nazik davranılacaktı. Lakin ilerleyen aylarda bu kuralların hepsi çiğnendi. </p><p dir="ltr">Filo burada bir süre dinlenip erzak tazelerken, asıl sorun kısa sürede gün yüzüne çıktı: Yerlilerden edindikleri erzaka rağmen ellerindeki stok yetersizdi. Vakit kaybetmeden tekrar yola çıkmaları ve bir ikmal noktasına ulaşmaları gerekiyordu. Güney Amerika kıyılarını takip ederek güneye inmeye devam ettiler ancak yolda şiddetli fırtınalara yakalandılar. Sonunda, Patagonya kıyılarında yer alan Puerto San Julián adlı ıssız doğal limana sığınmak zorunda kaldılar. Burada, yetersiz stok nedeniyle mürettebata erzak kısıtlaması getirildi ve bu da zaten yorgun ve moralsiz olan tayfanın hoşnutsuzluğunu daha da artırdı. Yine de en azından epey yol almış, artık ekvatorun güneyine geçmişlerdi. Balık açısından zengin bu korunaklı koyda kışı geçirmek üzere demir attılar.</p><p><br></p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752317208.jpg" style="width: 626px;"><br></p><p dir="ltr"><b>Bölünmüş Bir Dünya</b></p><p dir="ltr">Tordesillas Antlaşması hakkında kısa bir rehber</p><p dir="ltr">Tordesillas Antlaşması neydi?</p><p dir="ltr">1494’te imzalanan bu antlaşmayla dönemin iki süper gücü İspanya ve Portekiz dünyayı, daha doğrusu Avrupalılar tarafından yeni keşfedilmiş ve keşfedilmeyi bekleyen yerleri aralarında paylaşmıştı. Antlaşma, Avrupa merkezli dünya anlayışının ve sömürgecilik ideolojisinin bariz bir göstergesiydi. Buna göre, Afrika’nın batı kıyıları yakınındaki Yeşil Burun Adaları’nın yaklaşık iki bin km batısından geçen hayali bir meridyen çizildi. Bu çizginin batısı İspanya’ya, doğusu ise Portekiz’e ait sayıldı. Yeni Dünya’nın, yani Amerika’nın keşfi daha önce yapılan anlaşmaları altüst etmiş ve bu sınır çizgisiyle taraflar arasındaki gerilimlerin ve yıkıcı sömürge rekabetinin sona erdirilmesi amaçlanmıştı. Lakin kâğıt üstünde dünyayı bölmek kolay olsa da denizlerdeki çekişme yıllar boyunca sürecekti.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr"><b>Hangi bölgeler Portekiz’e aitti?</b></p><p dir="ltr">Sınır çizgisinin doğusunda kalan her yer Portekiz’in hâkimiyetindeydi. Bu topraklar ağırlıklı olarak Güney Atlantik ve Hint Okyanusu çevresindeki bölgeleri kapsıyordu. Portekiz, bu sular üzerinde dilediği gibi ilerleyebilir ve fethettiği yerleri sahiplenip kolonileştirebilirdi.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr"><b>Hangi bölgeler İspanya’ya aitti?</b></p><p dir="ltr">Sınır çizgisinin batısında kalan tüm topraklar İspanya’nın hâkimiyetine bırakılmıştı. Bu bölge, Batı Atlantik, Kuzey ve Orta Amerika’nın tamamı ile Güney Amerika’nın büyük bir kısmını içeriyordu. Ayrıca, haritanın bu tarafında kalan ve henüz keşfedilmemiş tüm toprakların da İspanya’ya ait olduğu varsayılıyordu. Ancak bu varsayım, dünyanın yuvarlak olduğu gerçeğini göz ardı etmişti. Zira batıya doğru ilerlemeye devam eden biri, eninde sonunda doğudan yine Portekiz’in bölgesine girecekti.</p><p><b><br></b></p><p dir="ltr"><b>Baharat Adaları kimin bölgesinde yer alıyordu?</b></p><p dir="ltr">Aslında Tordesillas Antlaşması’na göre Portekiz’e aitti, zira sınırın doğusundaydı. Ancak dünya yuvarlak olduğundan Macellan’ın seferi, Avrupa’dan batıya doğru yol alarak Endonezya, Malezya, Filipinler ve dolayısıyla Baharat Adaları’na ulaşmanın mümkün olduğunu göstermişti. Bu da demek oluyordu ki bu topraklar Tordesillas çizgisinin batısında kalıyordu. Yani kâğıt üstünde İspanya’ya aitti. Tordesillas Antlaşması ile yapılan paylaşım bir anda geçerliliğini yitirmiş, durum içinden çıkılmaz bir hal almıştı. 1529’da imzalanan Zaragoza Antlaşması ile taraflar, dünyayı ortadan bölen Tordesillas çizgisinin tam karşısına bir sınır daha çekerek bir karşı-meridyen belirledi. Ayrıca İspanya, Portekiz’den aldığı 350.000 duka karşılığında Baharat Adaları üzerindeki hak iddiasından resmen vazgeçti.</p><p><b><br></b></p><p dir="ltr"><b>Dünyanın çevresini ilk o mu dolaşmıştı?</b></p><p dir="ltr">Enrique of Malacca’nın hikâyesi</p><p dir="ltr">İspanyol kaynaklarında Enrique de Malaca, Portekizlilerde Henrique de Malaca, Malay anlatılarındaysa Panglima Awang ismiyle anılan Enrique of Malacca, 1511 civarında, Macellan’ın Baharat Adaları’na yaptığı bir ziyaret sırasında, henüz 14 yaşındayken onun tarafından köle olarak alındı. Armada de Molucca filosundaki tek köle oydu ve görevi, özellikle Macellan Boğazı’ndan geçtikten sonra ulaştıkları Büyük Okyanus adalarında çevirmenlik yapmaktı.</p><p dir="ltr">Enrique, 1511’de henüz bir çocukken Macellan’la birlikte batıya doğru yol alarak Avrupa’ya gitmiş ve yaklaşık on yıl sonra bu defa doğudan yaşadığı topraklara geri dönmüştü. Bu yolculuğun rotasına baktığımızda, aslında dünyanın çevresini başarıyla dolaşan ilk kişinin, Armada de Molucca’nın mürettebatından ziyade, Enrique’nin ta kendisi olduğunu söylemek mantıklı görünüyor. Bunu kendi iradesiyle ve özgür bir adam olarak yapmadı belki ama kuşkusuz o da bu önemli keşif seferinin bir parçasıydı. Macellan öldükten sonra, Enrique’ye verdiği söz de onunla birlikte mezara gömüldü. Vasiyetine göre özgür bırakılması gereken Enrique, bunun yerine köle olarak esir tutulmaya devam etti. Bu ihanete karşı sessiz kalmadı; Cebu Adası’ndaki yerli halkla iş birliği yaparak filonun komuta kademesine karşı bir komplo kurdu. Bunun sonucunda filo liderlerinin çoğu öldürüldü ve Enrique ortadan kayboldu. Sonrasında ona ne olduğu kesin olarak bilinmiyor. Ancak eğer doğduğu topraklara, yani Malakka’ya dönebildiyse, Cebu’dan yapacağı yaklaşık 2.500 kilometrelik son yolculukla, Enrique gerçekten de dünyanın çevresini dolaşan ilk insan olmuş olabilir.</p><p><b><br></b></p><p dir="ltr"><b>İsyan ve Kesif</b></p><p dir="ltr"><b>Tarih</b>: 1 Nisan – 28 Kasım 1520</p><p dir="ltr"><b>Konum</b>: Puerto San Julián (Arjantin), Macellan Boğazı (Şili)</p><p dir="ltr">Her ne kadar isyan girişimi nedeniyle tutuklanmış olsa da Cartagena’ya Victoria adlı gemide serbestçe dolaşma izni verilmişti. Gemi, filonun en büyüklerinden biriydi ve Cartagena bundan faydalanarak isyancı fikirlerini yaymaya devam etti. Macellan’ı bir kez daha pervasızlıkla suçladı ve bu kez yalnız değildi. Victoria, San Antonio ve Concepción gemilerinin kaptanları da onu destekledi. Böylece, beş gemiden sadece ikisi Macellan’a sadık kalmıştı. Otoritesini yeniden tesis etmek üzere harekete geçen Macellan, Victoria’yı zapt etmek için bir grup sadık adamını gemiye gönderdi. Yaşanan çatışma sırasında Victoria’nın kaptanı Luis de Mendoza boğazından bıçaklanarak öldürüldü. Dengeler hızla değişmişti. Concepción’un kaptanı Gaspar de Quesada kaçmaya çalıştıysa da yakalandı. Cartagena ise teslim olmayı seçti. </p><p dir="ltr">İsyanın bastırılmasının ardından yapılan yargılama sonucunda Concepción’un kaptanı Gaspar de Quesada idam edildi ve cesedi parçalanarak ibret olsun diye kıyıya bırakıldı. Aynı akıbet, boğazı kesilerek öldürülen Mendoza için de geçerliydi. Cartagena’nın cezası ise ölüm olmadı. Onun yerine, suç ortaklarından rahip Sanchez de Reina ile birlikte Puerto San Julián kıyısında kaderine terk edildi. Muhtemelen, filo İspanya’ya döndüğünde idamlarının yaratacağı tepkilerden çekinildiği için bu ikilinin hayatları bağışlanmıştı. Ayrıca, isyancılarla birlikte hareket ettiği belirlenen 40 denizci daha suçlu bulundu. Aralarında, ilerleyen süreçte filonun komutasını üstlenecek olan ve o sırada Concepción gemisinde başçarkçılık görevini yürüten Juan Sebastián Elcano da vardı. Bu denizcilerin rütbeleri düşürüldü ve en alt seviyedeki ağır işlere verildiler. Kış henüz tam anlamıyla atlatılmamıştı ama Macellan için zaman daralıyordu. Büyük Okyanus’a açılan geçidi bir an önce bulmak zorundaydılar. Temmuz ayında, filodaki en küçük karavel olan Santiago kıyı boyunca keşif yapmak üzere görevlendirildi. Gemi mürettebatı Santa Cruz’da daha korunaklı bir doğal liman bulmayı başardı ama dönüş yolunda Santiago kayalıklara oturdu ve battı. Mürettebatın tamamı olmasa da çoğu mucizevi bir şekilde hayatta kalmıştı. İçlerinden iki denizci tam 11 gün boyunca dağları aşarak filoya ulaşmayı başardı. Kurtarma operasyonundan sonra filo Ekim ayına kadar Santa Cruz’daki limanda demirledi. Kıyı boyunca güneye doğru tekrar yelken açmalarının ardından, 21 Ekim civarında Concepción ve San Antonio gemileri aniden çıkan fırtınayla bir körfeze sürüklendi. Bir su yolunun girişi olduğu anlaşılan bölgede incelemeler yapan Macellan ve tayfası, suyun tuzluluk derecesini, gelgit hareketlerini ve suyun açık denize doğru akışını dikkate aldıklarında, tesadüfen sürüklendikleri bu boğazın bir iç denize değil, Büyük Okyanus’a açılan bir geçit olabileceğine kanaat getirdiler. Ancak çeşitli kollara ayrılan geçit karmakarışık bir coğrafyaya sahipti. Filodaki gemiler kıvrımlı kıyılar boyunca yol alarak doğru rotayı bulmaya çalışırken, San Antonio bir noktada gözden kayboldu. Gemi mürettebatı filonun kalanını kazara mı kaybetmişti yoksa gemide yeni bir isyan mı patlak vermişti bilinmiyor ama sonuç olarak, San Antonio rotasını geri çevirerek İspanya’ya döndü. Filodaki diğer üç gemi ise geçidi takip ederek nihayet 28 Kasım’da Büyük Okyanus’a ulaşmayı başardı.</p><p><b><br></b></p><p dir="ltr"><b>Büyük Okyanus</b> </p><p dir="ltr"><b>Tarih</b>: 6 Mart – 28 Mart 1521</p><p dir="ltr"><b>Konum</b>: Guam, Filipinler</p><p dir="ltr">Güney Atlantik’in dalgalı sularından ve sert fırtınalarından sağ çıkmayı başaran mürettebat için Büyük Okyanus’un engin ve sakin yüzeyi ilk başta rahatlatıcı görünmüştü. Ancak çok geçmeden bu denizin, hayal ettiklerinden katbekat büyük olduğunu anladılar. Yanlarına aldıkları erzak okyanusu geçmek için yeterli değildi. 98 gün boyunca karaya ayak basamadan yol alan mürettebat arasında özellikle meyvelerden alınan C vitamini eksikliği nedeniyle iskorbüt hastalığı baş gösterdi ve 29’unun ölümüne neden oldu. O sırada farkında olmasalar da bu yolculuk, insanlık tarihinin o zamana kadarki en uzun mesafeli keşif seferi olarak kayıtlara geçecekti.</p><p dir="ltr">Mart ayının başlarında, uzun zaman sonra karanın göründüğü ilk yer Guam oldu. Çamorro halkı, kano benzeri, “proa” adı verilen çift gövdeli tekneleriyle filoyu karşıladı. İspanyol gemilerindeki mürettebat bu tür ince yapılı ve süratli tekneleri daha önce hiç görmemişti. Ancak ilk temas pek de dostane olmayacaktı. Çamorro’ların Avrupalılardan oldukça farklı bir mülkiyet anlayışı vardı ve gemilere çıkarak, gördükleri eşyaları sahiplenip almaya başladılar. Başta ufak tefek gerilimler yaşansa da taraflar çok geçmeden bir tür ticaret ilişkisi kurmayı başardı. Ancak iş, Macellan’ın kişisel sandalının alınmasına kadar varınca, ilişkiler yeniden gerildi. Bunu şahsi bir hakaret olarak gören Macellan, adamlarına Çamorro köyünü ateşe vermelerini emretti. Yaklaşık 50 ev yanıp kül olurken, çıkan çatışmalarda yerlilerden yedisi öldürüldü. Guam’daki gergin olaylardan sonra Macellan ve mürettebatın tavrı değişti. Sonraki haftalarda Suluan, Homonhon ve Limasawa adalarında yerlilere nispeten temkinli yaklaştılar ve bu kez daha ziyade Hristiyanlık inancını yayma arzusuyla hareket ettiler. Adamlarına ateşli silahları ve zırhlarıyla gösteriler yaptıran Macellan, bu sayede yerlilere gözdağı verip saldırıları önlemeyi amaçlıyordu. Vakanüvis Antonio Pigafetta’ya göre, yolculuğun bu kısmında kurulan temaslar çok daha dostane ve barışçıl bir havada geçti. Hatta Limasawa Kralı Kolambu, Macellan’la bir “kan kardeşliği” töreni bile düzenlemişti. Bu adalarda dikkat çeken bir diğer gelişme ise Macellan’ın yıllar önce Doğu’daki bir seferinde esir aldığı kölesi Enrique de Malaca’nın, yerel halkla Malayca konuşarak iletişim kurabilmesiydi. Eğer bu bölge gerçekten onun doğduğu topraklara yakınsa, o zaman bu yolculuk onu yurduna geri getirmiş demekti. Bu durumda Enrique, zorla kaçırılarak ve istemeden de olsa, tüm dünyayı dolaşarak kendi topraklarına dönen tarihteki ilk insan olmuştu.</p><p><b><br></b></p><p dir="ltr"><b>Macellan’ın Ölümü</b></p><p dir="ltr"><b>Tarih</b>: 7 Nisan – 27 Nisan 1521</p><p dir="ltr"><b>Konum</b>: Cebu, Mactan</p><p dir="ltr">Armada de Molucca yol aldıkça yerel topluluklarla iletişim kurma konusunda ustalaşıyordu ancak bir yandan da bu coğrafyadaki siyasi çekişmelerin içine çekiliyor, giderek daha fazla taraf hâline geliyordu. Filo Cebu Adası’na ulaştığında, Macellan adanın lideri Humabon’la tanıştı ve burada bir kez daha geleneksel “kan kardeşliği” töreni düzenlendi. Gelinen noktada Macellan, artık sadece bir kâşif değil, neredeyse bir haçlı seferi yürütür gibi davranıyordu. Tehdit ve cömertlik arasında gidip gelen yöntemlerle, yalnızca Cebu’da yaklaşık 2.200 kişiyi Hristiyanlığa geçirdiği tahmin ediliyor. Diğer taraftan, Humabon’un gösterdiği misafirperverliğin bir karşılığı vardı: Macellan, düşmanlarına karşı onun yanında olacağına söz vermişti. Böylece gözler, Mactan Adası’nın lideri Lapu-Lapu’ya çevrildi.</p><p dir="ltr">Savaşı başlatmak için Macellan’ın ortaya attığı bahane Lapu-Lapu’nun Hristiyanlığı reddetmesiydi. Filo mürettebatı, Kral I. Charles’ın kendilerine verdiği görevin savaşmak olmadığını söyleyerek itiraz etti. Ancak Macellan bu uyarıları dikkate almadı ve zırhlarını kuşanmış 60 adamıyla birlikte Mactan’a doğru yola çıktı. Yanlarında az sayıda Cebu savaşçısı da vardı ama onlara yalnızca çatışmayı izlemeleri ve Avrupalıların savaş becerilerine tanık olmaları söylenmişti.</p><p dir="ltr">Ne var ki arazi şartları istilacılar için hiç de elverişli değildi. Gelgit nedeniyle sahil ve orman hattı arasında uzun bir mesafe oluşmuştu; filodaki gemilerse çatışmaya destek verecek menzilin dışındaydı. Karaya çıkmalarının ardından Macellan ve adamları açıkta ve korumasız kaldı. Lapu-Lapu’nun emrindeki yaklaşık 1.500 savaşçı ise sayıca üstünlüklerini ve arazinin avantajını kullanarak saldırıya geçti. Mactanlılar, zırhların zayıf noktası olan bacakları hedef alıyor, zehirli oklarla saldırıyorlardı. Bu oklardan biri de Macellan’a isabet etmişti. Yenilginin kaçınılmaz olduğunu gören Macellan geri çekilme emri verdi ve Cebu savaşçıları yardıma koşarak hayatta kalanların gemilere ulaşmasını sağladı. Fakat Macellan düşman hatlarının gerisinde kalmış, Mactanlı savaşçıların elinde can vermişti. Armada de Molucca’nın kaptanı ve başkumandanı hayatını kaybederken, Lapu-Lapu sömürgecilere karşı direnişin sembolü hâline geldi. Efsanevi savaşçı, Filipinler’de halen ulusal bir kahraman olarak anılıyor.</p><p><b><br></b></p><p dir="ltr"><b>Kanlı Ziyafet</b></p><p dir="ltr"><b>Tarih</b>: 28 Nisan – 1 Mayıs 1521</p><p dir="ltr"><b>Konum</b>: Cebu</p><p dir="ltr">Macellan’ın Mactan kıyılarında öldürülmesinin ardından mürettebat yeni bir lider seçmek zorunda kalmıştı. Sonunda, Portekizli ve İspanyol temsilcilerin birlikte görev aldığı bir eş kaptanlık düzeninde karar kılındı. Macellan’ın kayınbiraderi Duerte Barbosa ile Santiago gemisinin kaptanı Juan Rodriguez Serrano, filonun yeni liderleri oldu.</p><p dir="ltr">Gelgelelim, yeni kaptanların aldığı ilk kararlardan biri, ilerleyen günlerde kendi sonlarını hazırlayacaktı. Macellan, ölmesi durumunda, yanında uzun yıllar boyunca hizmet etmiş kölesi Enrique de Malaca’nın özgür bırakılmasını vasiyet etmişti. Ancak Barbosa ve Serrano bu talimatı görmezden geldi. Muhtemelen, Enrique’nin Filipinler’den Endonezya ve Malezya’ya kadar sürecek seyahatte kendilerine tercümanlık yapmaya devam etmesini istiyorlardı. Ancak resmî gerekçe olarak, Enrique’nin İspanya’ya dönmesi ve Macellan’ın dul eşi Beatriz Barbosa’ya hizmet etmeyi sürdürmesi gerektiğini öne sürdüler. Özgürlük şansı elinden alınan Enrique büyük bir hayal kırıklığı içindeydi. Pigafetta’nın kayıtlarına göre, savaşta Macellan’ın yanında çatışırken yaralandığı için gemide kalıp iyileşmek ve olup biteni hazmetmek istiyordu. Ama eş kaptan Barbosa, hemen gemiden inip görevine devam etmemesi hâlinde kırbaç cezası vereceğini söyledi. Bu tehdit bardağı taşıran son damlaydı. Enrique’nin, intikamını alması ve özgürlüğüne kavuşması uzun sürmeyecekti. Yine Pigafetta’nın aktardıklarına göre Enrique, Kral Humabon ile konuşarak ona bir teklifte bulundu ve eğer iş birliği yaparlarsa filodaki tüm hazineyi ve değerli malları ele geçirebileceğini söyledi. Enrique’den filo hakkında stratejik bilgiler edindiği bu görüşmenin ardından Humabon, yeni kaptanları bir ziyafete davet etti. Çoğunluğu subay olan otuz adam ziyafete katıldı ve yemek sona erdiğinde silahlı Cebu savaşçıları etraflarını sarıp 27’sini öldürdü. Macellan’ın Mactan’da kendi rakibi karşısında bozguna uğrayışına tanık olan Humabon’un bu şaşırtıcı hamlesi bir yandan ihanet gibi görünse de esasen halkının gözünde itibarını korumak ve kendisine olan sadakatin sürmesini sağlamak için attığı bir adımdı aynı zamanda. </p><p dir="ltr">Humabon fidye için Serrano’yu hayatta tuttu. Lakin filoda komutayı devralan João Lopes Carvalho ve mürettebatın geri kalanı, Cebuluların her geçen gün daha fazla silah talep etmesinden işin nereye varacağını anlamışlardı. Sonunda Serrano’yu kaderine, muhtemelen de ölüme terk edip yelken açtılar.</p><p><b><br></b></p><p dir="ltr"><b>Tükenen Mürettebat</b> </p><p dir="ltr"><b>Tarih</b>: 2 Mayıs – 9 Temmuz 1521</p><p dir="ltr"><b>Konum</b>: Filipinler, Brunei, İspanya</p><p dir="ltr">Yaklaşık iki yıl önce Sevilla’dan yola çıkan Armada de Molucca’nın mürettebatından geriye sadece 115 adam kalmıştı. Bir gemi okyanusta kaybedilmiş, bir diğeri ise muhtemelen bir isyan sonucu rotasını değiştirerek İspanya’ya geri dönmüştü. Macellan da yerine geçen kaptanlar da artık hayatta değildi. Tüm bu yaşananların yanı sıra Büyük Okyanus’un acımasız gerçeklerinin de giderek daha fazla farkına varan mürettebat, keşif seferinin asıl amacına odaklanmaya karar verdi: Baharat Adaları’na ulaşıp gemilerin ambarlarını karanfille doldurmak ve İspanya’ya zengin adamlar olarak dönmek... Lakin çok geçmeden acı bir gerçekle yüzleştiler: Kalan üç gemiyi yüzdürmek için yeterli adam yoktu. İçlerinde en harap durumda olan, tahta kurularının istilasına uğramış Concepción’u denizin ortasında terk edip ateşe verdiler.</p><p dir="ltr">Bu aşamadan sonra yolculuk tamamen farklı bir şekilde seyretmeye başladı. Yerel teknelerle karşılaşmalar giderek daha vahşi bir hâl aldı ve kimi zaman düpedüz korsanlığa varan çatışmalara sahne oldu. Karaya çıktıklarında artık dostça karşılanmayı beklemiyor, yalnızca ticaret yapmak ve erzak depolamak için duruyorlardı. Bu karmaşık adalar dizisinde yollarını bulabilmek içinse yerel teknelerdeki kılavuz kaptanları alıkoydular. Zorla çalıştırılan bu kılavuzlar zaman zaman filoyu tamamen aksi yöndeki limanlara götürse de en azından böylece gemiler sürekli erzak tedarik etmeye devam edebiliyordu. </p><p dir="ltr">Bu sırada aslında filonun açık denizlerde bir gemisi daha vardı ve aylar sonra, 6 Mayıs 1521’de nihayet Sevilla limanına ulaştı. Bu gemi, Güney Amerika kıyılarında bilerek ya da bilmeyerek filonun geri kalanıyla irtibatını kaybeden ve altı aydan uzun süredir tek başına seyreden San Antonio’ydu. Macellan’a veya diğer gemilere ne olduğuna dair hiçbir fikirleri yoktu ama emin oldukları bir şey vardı: Büyük Okyanus’a açılan geçit, yani günümüzdeki adıyla Macellan Boğazı bulunmuştu. Bu önemli keşfe rağmen San Antonio mürettebatı Macellan’ı ağır bir dille suçlamaya başladı. Onu, acımasız bir yönetim sergilemek ve Portekiz lehine hareket ederek İspanya’ya ihanet planları kurmakla itham ettiler. Bazıları yolculuk esnasında yaşanan isyanlara katılmıştı ve kendilerini bu iddialarla haklı göstermeye çalışıyorlardı. Belli ki anlattıkları etkili olmuştu, zira Macellan’ın ailesi İspanya’da ev hapsine mahkûm edildi.</p><p><b><br></b></p><p dir="ltr"><b>Baharat Adaları</b></p><p dir="ltr"><b>Tarih</b>: 21 Eylül 1521 – 6 Nisan 1522</p><p dir="ltr"><b>Konum</b>: Brunei, Malakka</p><p dir="ltr">João Lopes Carvalho’nun liderliği, filoda huzursuzluk yaratan bir dönem oldu. Aylar süren zorlu yolculuklardan yorgun düşmüş ve artık sabrı tükenmiş mürettebat onun kararlarına giderek daha fazla karşı çıkmaya başlamıştı. Mola verdikleri limanlarda Carvalho, İspanya Kralı I. Charles’a sunmak üzere gemiye köleler aldı ve aralarında üç kadın da vardı. Ancak daha sonra kadınları kendine ayırarak Trinidad gemisinde küçük bir harem kurdu. Tahmin edileceği üzere bu durum mürettebatın hiç hoşuna gitmemişti. Macellan hayattayken, kendi kölesi Enrique hariç hiçbir kölenin ve hiçbir kadının gemilere alınmasına izin verilmiyordu. Carvalho’nun, kuralları hiçe sayan bu tavrı, sonunda ipleri kopardı ve mürettebat ondan görevi bırakmasını istedi. Yerine Martin Mendez seçildi. Ayrıca, Gonzalo de Espinosa, Trinidad gemisinin kaptanlığına, Juan Sebastián Elcano ise Victoria’nın kaptanlığına getirildi. Aralarındaki tek deneyimli seyrüseferci Elcano olduğundan, zamanla söz hakkı ve kontrol ona geçecekti. Onun öncülüğünde filo, 8 Kasım 1521’de Baharat Adaları’na, yani Maluku Adaları’na vardı. Burada, yerel lider Al-Mansur tarafından sıcak bir şekilde karşılandılar. Portekiz’in bölgedeki ticareti tekeline alma çabalarına boyun eğmek istemeyen Al-Mansur, yeni tüccarlarla iş birliği yapmaya fazlasıyla hevesliydi. Bu arada filo mürettebatı kaygı verici bir haber de aldı: Portekizliler yaklaşık iki yıldır, yani yola çıktıklarından beri onları arıyordu. Vakit kaybetmeden bir ticaret noktası kurarak mal alımına başladılar. İki gemi de karanfil başta olmak üzere değerli mallarla dolduruldu. Ancak Aralık ayında, dönüş hazırlıkları tamamlanmak üzereyken, Trinidad su almaya başladı. Gemi acil onarıma ihtiyaç duyduğundan, mürettebatın yarısının Trinidad’da kalıp onarımla ilgilenmesine, diğerlerininse Victoria ile batıya doğru ilerleyerek, dünyanın çevresindeki turlarını tamamlayıp İspanya’ya dönmesine karar verdiler. Onarımın ardından Trinidad doğuya, Büyük Okyanus üzerinden Amerika’nın doğu kıyılarına yelken açacaktı. Burada geminin değerli yükü karadan Amerika’nın Atlantik kıyısına taşınacak ve oradan da başka bir gemi bulunarak İspanya’ya ulaştırılacaktı. Zaten hasarlı olan Trinidad, ters akıntı ve güçlü rüzgârlar nedeniyle Macellan Boğazı’nda Batı’dan Doğu’ya geçiş yapamayacağından, mürettebatın başka çaresi yoktu. Gelgelelim Trinidad nihayet yola çıktığında işler hiç iyi gitmedi. Şiddetli fırtınalarla hırpalanan gemide mürettebatın çoğu iskorbüt hastalığına yakalandı ve 30 adam hayatını kaybetti. Durumun içinden çıkılamaz hâle gelmesi üzerine geri dönmeye karar verdiler ama Tidore Adası’na vardıklarında Portekizlileri orada kendilerini beklerken buldular. Trinidad, Portekizliler tarafından yağmalandı ve geriye kalan enkaz tropik fırtınaların insafına bırakıldı.</p><p><b><br></b></p><p dir="ltr"><b>Tek Gemi Geri Döner</b></p><p dir="ltr"><b>Tarih</b>: 21 Aralık 1521 – 8 Eylül 1522</p><p dir="ltr"><b>Konum</b>: Maluku Adaları, Ümit Burnu, Sevilla</p><p dir="ltr">Juan Sebastián Elcano, Hint Okyanusu’na açılarak Ümit Burnu’nu dolaşıp İspanya’ya dönmeyi planlamıştı. Bu riskli bir yolculuktu ama başka seçenekleri yoktu. Mürettebat arasında, Victoria ile bu tehlikeli maceraya atılmak istemeyip Trinidad’da kalmayı tercih edenler olmuştu lakin bu karar onlar için hiç de iyi sonuçlanmayacaktı. Victoria, 63 kişilik mürettebatla yelken açtı ama aslına bakılırsa o da yolculuk boyunca epey yıpranmıştı ve pek de iyi bir durumda değildi. Büyük hayallerle başlayan Armada de Molucca seferinin artık tek bir amacı vardı: hayatta kalmak ve eve dönebilmek.</p><p dir="ltr">Zorlu koşullar altında batıya doğru ilerleyen Victoria, 6 Mayıs’ta Ümit Burnu’na ulaştı ama şiddetli fırtınalar ve geçit vermeyen vahşi akıntılar yüzünden kıtanın batı kıyısına güvenli biçimde geçmeleri 22 Mayıs’ı buldu. Uzunca bir süredir karaya çıkıp erzak tazeleme şansları olmadığından yolculuk sırasında yine iskorbüt gemiyi kasıp kavurmuş ve 21 denizci hayatını kaybetmişti.</p><p dir="ltr">Yolculuğun sonlarına yaklaşırken, erzak ve su ikmali için Portekiz egemenliğindeki Yeşil Burun Adaları’na uğramak zorunda kaldılar. Artık gemiden ve bitmek bilmeyen yolculuktan bıkan bazı mürettebat üyeleri, geminin görevini ve taşıdığı yükü ifşa ederek Portekizlilere sığınmak istedi. Ancak hiç de bekledikleri gibi karşılanmadılar ve tutuklandılar. Açıkta demirlemiş olan Victoria, Portekizliler harekete geçemeden 15 Temmuz’da hızla tekrar denize açıldığında, geriye sadece 22 kişi kalmıştı. Gemiye el konulması riskini almak istemeyen mürettebat, arkadaşlarını geride bırakmayı seçmişti. Ne olursa olsun, bu yolculuğu tamamlamaya kararlıydılar.</p><p dir="ltr">Victoria, nihayet 6 Eylül 1522’de Sanlúcar limanına ulaştı. İki gün sonra ise Guadalquivir Nehri boyunca ilerleyerek Sevilla’ya vardılar. Gemi öylesine harap durumdaydı ki mürettebat gövdeye dolan suyu limana girene kadar tahliye etmeye devam etti. Hayatta kalan yalnızca 18 adam vardı. Öte yandan, sadece tek bir geminin taşıdığı baharat yükü bile tüm seferin kârla sonuçlanmasına yetmişti. Fakat para her şeyi unutturmuyordu. Bu yolculuk mürettebatı epey hırpalamıştı ve çoğu, yaşadıkları acı deneyimlerin yüküyle sessizliğe bürünmüştü. Denizciler tam 37.560 deniz mili (69.575 km) yol katetmişlerdi. Bu sıra dışı seyahat, yalnızca dünyanın yuvarlak olduğunu değil, aynı zamanda sanıldığından çok daha büyük olduğunu da göstermişti. Diğer taraftan, denizciler arasında yıllardır anlatılan deniz kızları ve kaynayan okyanuslar gibi efsaneler bir bir çürütülmüştü ama doğanın öfkesinin ve insanın zalimliğinin aynı derecede korkutucu olduğu da anlaşılmıştı. Yine de her şeye rağmen evlerine zengin dönmeyi başarmışlardı. Macellan’ın başlattığı seferi tamamlayan Elcano, şövalye ilan edildi. Ayrıca, yolculuk sırasında isyanlara karışmış olmasına rağmen kral onu affetti ve ömür boyu maaşla ödüllendirdi. Macellan’la birlikte onun adı da tarih kitaplarında yer alacaktı.</p><p><b><br><br></b></p><p dir="ltr">Görseller üzerindeki yazılar:</p><p><b><br></b></p><p dir="ltr">Vakanüvis Pigafetta yolculuk boyunca Macellan’a sadık kaldı</p><p><b><br></b></p><p dir="ltr">Alman sanatçı Theodor de Bry’nin, Macellan’ın seyahatlerini resmettiği bir alegorisi</p><p><b><br></b></p><p dir="ltr">Ferdinand Macellan, kahramanı Kristof Kolomb’un izinden gitmek istiyordu</p><p><b><br></b></p><p dir="ltr">Filo, Atlantik Okyanusu’nu geçmeye çalışırken sürekli fırtınalarla boğuştu</p><p><b><br></b></p><p dir="ltr">Pigafetta, notlarında uçamayan ve tüyü olmayan bazı kuşlardan bahsetmişti. Tabii penguenlerden söz ettiğini bilmiyordu</p><p><b><br></b></p><p dir="ltr">İsyanın elebaşlarından kimi öldürüldü, kimiyse sürgün edildi. Geri kalanlarınsa canı bağışlandı</p><p><b><br></b></p><p dir="ltr">Filo mürettebatı, günümüzde Macellan Boğazı olarak bilinen bu geçide Patagonya Boğazı adını vermişti</p><p><b><br></b></p><p dir="ltr">Macellan, Mactan Muharebesi’nde Avrupalıların silah ve zırhlarının gücünü sergilemek isterken sayıca ezici bir üstünlükle karşı karşıya kaldı</p><p><b><br></b></p><p dir="ltr">7 Haziran 1494’te İspanya ve Portekiz arasında Tordesillas Antlaşması imzalandı</p><p><b><br></b></p><p dir="ltr">Deneyimli bir denizci ve seyrüseferci olan Elcano, sefer esnasındaki kaptanlık seçimlerinde defalarca geri plana atılmış olmasına içerlemişti</p><p><br></p><p dir="ltr">Macellan’ın hayatta kalan adamları İspanya’ya döndükten sonra onun onuruna bir geçit töreni düzenlendi</p>',
