            29 => 
            array (
                'id' => 45,
                'in_title' => 'Çin’in en çok satan aracı Geely Xingyuan’ı, Çin’de test ettik',
                'out_title' => 'Çin’in en çok satan aracı Geely Xingyuan’ı, Çin’de test ettik',
                'slug' => 'cinin-en-cok-satan-araci-geely-xingyuani-cinde-test-ettik-1',
                'summary' => 'Çin’in en çok satan aracı Geely Geome Xingyuan, Avrupa’da B segmentinde de dengeleri değiştirecek.',
            'content' => '<p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752645551.png" style="width: 857.625px;"></p><p>Çin’in en çok satan aracı Geely Geome Xingyuan, Avrupa’da B segmentinde de dengeleri değiştirecek.</p><p>• Geely’nin geçen yılın ikinci yarısında, Geome ürün ailesi içerisinde tanıttığı, elektrikli B hatchback, Xingyuan Avrupa pazarında B segmentinde dengeleri değiştirebilir. Bunu da şuradan söyleyebiliyoruz; Xingyuan Çin iç pazarında da bu segmentteki rekabette dengeleri kısa sürede değiştirdi ve adetsel bazda üstünlüğü eline geçirdi. Birkaç ay içerisinde 100.000 adetlik üretim başarısına ulaşan Xingyuan, Ocak 2025’te ise 28 bin adet satarak, tüm segmentlerdeki hatchbach ve sedan araçlar arasında liderliğe yükseldi. BYD’nin A segmentindeki başarılı modeli Seagull ise aynı ay 18 bin adetlik satışla, listeye 10’uncu sıradan dahil olmuştu.</p><p>• Geçtiğimiz Şubat ve Mart aylarında da Xingyuan, aylık 32 bin adetlik satışlara ulaşarak yine liderliğe oynadı. Çin fiyatları 9 bin dolardan başlıyor. En üst modelde fiyat 13 bin dolara kadar çıkıyor. Bu araç, Avrupa pazarına geldiğinde, sunduklarıyla, 20 bin Euro’nun altındaki Avrupalı elektrikli modellerle rahatlıkla mücadele edebilecek teknik özelliklere sahip.</p><p>• Toplam uzunluğu 4.135 mm olan Xingyuan, Renault Clio’dan, 8,5 cm daha uzun. 5 kişilik Xingyuan’ın bagaj hacmi 375 lt. Ayrıca önde de 70 lt hacimli bir Frunk daha sunuluyor. Renault Clio E-Tech Hybrid’in bagaj hacmi ise 254 lt. Belki de Geely Xingyuan’ı hibrid Clio yerine, tam elektrikli Renault 5 (Five) ile karşılaştırmak lazım ancak B segmentte dengeler değişecekse, segment lideri Clio da bundan etkilenebilir.</p><p>• Geely Xingyuan’ın büyük pilli versiyonunda, 85 kW’lık (114 HP) elektrik motoru var. Xingyuan arkadan motor ve arkadan itiş düzenine sahip. Xingyuan’ın 2 farklı boyutta (30 kWh ve 40 kWh) batarya paketi var. Batarya boyutlarına göre 310 km ve 410 km (CLTC) menzil sunabiliyor. CATL tarafından tedarik edilen LFP kimyaya sahip bataryalar, DC şarjı destekliyor ve yüzde 30’dan yüzde 80’e 18 dakikada dolabiliyor.</p>',
