            32 => 
            array (
                'id' => 48,
                'in_title' => 'Temmuz ayında ne ekilir? Ay takvimi',
                'out_title' => 'Temmuz ayında ne ekilir? Ay takvimi',
                'slug' => 'temmuz-ayinda-ne-ekilir-ay-takvimi-1',
                'summary' => 'Temmuz ayında ne ekilir? Bu ay bitkiler için bahçede ya da evinizde neler yapmanız gerektiğini biliyor musunuz? Ay takvimi ile anlattık.',
            'content' => '<div class="col-12 fs-24 secondary-font mb-4 fw-500"><p>Temmuz ayında ne ekilir? Bu ay bitkiler için bahçede ya da evinizde neler yapmanız gerektiğini biliyor musunuz? Ay takvimi ile anlattık.</p></div><div class="item-content"><p>Temmuz ayında ne ekilir? Bu ay bitkiler için bahçede ya da evinizde neler yapmanız gerektiğini biliyor musunuz? Ay evrelerinin dönüşümleriyle uygulanan bahçecilik çok eski yıllara dayanan bir yöntem. Eski bir kültür olmasının yanında elbette bilimsel bir gerçekçiliğe de dayanıyor. Bu rehber doğrultusunda siz de her ay Ay takvimine göre bahçe işleri ile buluşabilirsiniz.</p><h3 class="wp-block-heading">TEMMUZ AYINDA BİTKİLER İÇİN YAPILACAKLAR – AY TAKVİMİ</h3><p>Her sabah ya da ayın ilk günlerinde burç yorumlarınızı okuyanlardan mısınız? Bu sayfayı dikkatlice inceliyorsanız, cevabınızın da “Evet” olduğunu duyar gibiyiz. Astroloji ile ilgili çeşitli araştırmalar yapmaya başladıktan ve takip ettikten sonra kozmik enerjisi sizi kendine bağlar. Sonra bir bakmışsınız, Dolunay zamanı işlere mola veriyorsunuz! Aslında farkında olmadan o enerji ile istem dışı bazı işleri bırakıyoruz veya yenilikler peşinde koşuyoruz.</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646523.jpg" style="width: 857.625px;"></p><p>Çözüm aradığınız bazı soruların sırlarının da aslında evrende açık bir şekilde ilan edildiğini görebilirsiniz. Mesela; son dördün olduğu günlerde gergin bir enerji hakim olduğu için ruhsal anlamda huzursuz hissederiz. Motivasyonumuz düşer, enerjimizin tükendiği hissine kapılabiliriz. Bu süreçte yeni bir işe başlamak uygun değildir. Ay’ın rehberliğinde bahçe işleri de aynı özellikleri taşıyor. Toprakta yükselen su zamanında sulama yapmamalı, olumsuz hasat mevsiminde meyveleri dalında bırakmalısınız.</p><ul class="wp-block-list"><li><strong>Bu yazımız da ilginizi çekebilir: <a href="https://www.evimdergisi.com.tr/temmuz-ayinda-acan-cicekler-nelerdir-iste-6-farkli-cicek/" rel="noreferrer noopener" target="_blank">Temmuz ayında açan çiçekler nelerdir? İşte 6 farklı çiçek</a></strong></li><li><strong><a href="https://www.evimdergisi.com.tr/haziran-temmuz-ve-agustosta-bahcede-neler-yapilmali/" rel="noreferrer noopener" target="_blank">Haziran, Temmuz ve Ağustos’ta bahçede neler yapılmalı?</a></strong></li></ul><h3 class="wp-block-heading">TEMMUZ AYINDA YAPILACAKLAR</h3><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646567.jpg" style="width: 730px;"></p><p><strong>İLK 15 GÜN: </strong>Geçen ay gerçekleşen ikizler burcunda Halkalı güneş tutulması sonrasında yeni bir ayın enerjisi ile bahçede kalan işlere devam! <strong>Sebze bahçesi bu aydan itibaren hareketleniyor. </strong>Bu sayede bahçeden dalından kopardığınız çilek, domates, biber sofralarınızı süsleyebilir.</p><p><strong>Bu ayın ilk dört günü bahçede çıkan yabani otları temizleyebilirsiniz. </strong>Bu uygulama için eller görev başına! Yabani otun kökünü toprak altında bırakmadan çıkarmalısınız, bu sayede tam bir temizlik yapmış olursunuz.</p><p><strong>Bahçede oluşan meyveleri de yine 1-5 Temmuz günlerinde toplayabilirsiniz. </strong>Hasat fazlaysa o zaman konserve yapabilir veya dondurucuya atabilirsiniz.</p><p>Bahçe işlerinde dikim sevenler içinse ayın 5-15 arası işlere devam niteliğinde güzel bir enerji hakim! <strong>6-7-8 Temmuz günlerinde fazla sulama yapmamalısınız.</strong> Toprakta su miktarı arttığı için köklerde çürüme olabilir. Ama unutmayın ki, havaların fazla sıcak olmasından dolayı bu ay sulama bahçe için çok önemli.</p><p>Dünyadaki su kaynaklarının da azaldığını düşünerek bitkiler için <strong>damla sulama sistemi oluşturabilirsiniz. </strong>Böyle bir sistem kuramıyorsanız da bitkilerin direkt köklerine gelecek şekilde su verin. Sulamayla birlikte topraktan mineral ve vitaminlerin de gittiğini biliyorsunuz, bunun için dönem dönem gübre takviyesinde bulunmalısınız.</p><p><strong>11-12 Temmuz günlerinde ise gübre vermemelisiniz.</strong> Bitkilerde kuruma meydana gelebilir.</p><h3 class="wp-block-heading">BAHÇE İŞLERİNDE 2. DÖNEM</h3><p>Yaz döneminde bahçe işlerine hız vermelisiniz.<strong> Ara ara yağan yağışlardan sonra bahçede böceklenme olabilir. </strong>Domates için beyaz veya kabuklu bitler, fasulyelerde oluşan hastalıklar… Hepsi ile biyolojik mücadele yapabilirsiniz. Biraz sabır, biraz da özen göstererek kimyasal ilaçlama yapmadan ürünlerinizi koruyabilirsiniz.</p><ul class="wp-block-list"><li><strong>İlginizi çekebilir: <a href="https://www.evimdergisi.com.tr/saksi-bitkilerinde-hangi-boceklenmeler-olur-kurtulma-yollari/" rel="noreferrer noopener" target="_blank">Saksı bitkilerinde hangi böceklenmeler olur? Kurtulma yolları</a></strong></li><li><strong><a href="https://www.evimdergisi.com.tr/bahceniz-icin-sivrisinek-kovucu-9-bitki-ile-bu-yaz-rahat-gecsin/" rel="noreferrer noopener" target="_blank">Balkonda sineklerden kurtulmak için ne yapılabilir? Sivrisinek kovucu 9 bitki</a></strong></li></ul><p>15-16-17-18-19 ve 20 Temmuz günlerinde bahçede boş kalan yerlere <strong>yazlık tohumlar dikebilirsiniz.</strong> Dikim için genelde sabah erken ya da geç saatleri tercih edin. Güneş tüm enerjinizi almasın.</p><p>16-17 Temmuz ve 24-25-26 Temmuz tarihlerinde de <strong>sulama için ara vermelisiniz.</strong></p><p>20-21-22-23 Temmuz günleri ise, hasat yapmak için yıldızlı en bereketli günler arasında yer alıyor. Çiçeksiz bir yaz bahçesi düşünülemez bunun için rotanızı size en yakın olan fidanlığa çevirin ve <strong>bölgenizde, bahçenizde en iyi yetişebilecek çiçekleri alın</strong>. Bu tür bitkileri seçerken üzerinde tomurcuklar olmasına dikkat edin. Bu sayede bahçenize geldikten sonra çiçeklenme süresi devam edecek demektir.</p><p>23-24-25-26 Temmuz günleri çiçeklenme için doğru bir dönem. <strong>Solan çiçekleri ise zaman kaybetmeden kesmeyi ihmal etmeyin.</strong></p><p>24 Temmuz günü <strong>bahçede genel bir bakım yapabilir ve gübreleme ile bahçenizi kuvvetlendirebilirsiniz.</strong></p><p>29-30 Temmuz günlerinde ise <strong>fazla sebzelerinizi kışlık için buzluğa atabilirsiniz. </strong>Bu sayede mevsimi geçen sebze ve meyveleri farklı zaman diliminde de tüketebilirsiniz. Elbette her ürünü zamanında tüketmek en doğrusu. Bunun için fazla hasatlarınızı çevrenizle paylaşabilirsiniz.</p><h3 class="wp-block-heading">TEMMUZ AYINDA NE EKİLİR?</h3><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646607.jpg" style="width: 857.625px;"></p><p>Temmuz ayında ne ekilir? Biyodinamik takvim, ay ve gezegenlerin burç kuşağındaki hareketine göre hazırlanmış rehber bir takvim. Maria Thun tarafından geliştirilmiş ve günümüzde de pek çok çiftçi tarafından kullanılıyor. Bu takvimde on iki yıldız, dört grup altında toplanmış. Bu gruplar: Kök, Yaprak, Çiçek ve Meyve olarak tanımlanmış. Hangi günlerde ne tür bitkilerin ekilmesinin uygun olduğu gibi konularda yol göstericidir.</p><h4 class="wp-block-heading">YAPRAK (SU ELEMENTİ)</h4><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646633.jpg" style="width: 669px;"></p><p>Yaprakları ve sapları kullanılan sebzelerin ekilmesi, şaşırtma yapılması ve bahçede yerine yerleştirilmesi için uygun zaman. Yapraklı bitkiler çiçek günlerinde veya meyve günlerinde hasat edilmelidir. Yaprak günlerinde hasat edilen ürünler daha kısa sürede çürümeye başlar. Bu ay, <strong>bamya, patlıcan, <a href="https://www.evimdergisi.com.tr/domates-ekimi-ve-bakimi-nasil-yapilir-saksida-domates-uretin/" rel="noreferrer noopener" target="_blank">domates</a>, taze fasulye</strong> öne çıkıyor. Ayrıca<strong> börülce, çeşitli biberler, kabak ve salatalık </strong>da listenizde yer alabilir.</p><h4 class="wp-block-heading">MEYVE (ATEŞ ELEMENTİ)</h4><p>Meyve ve tohumlu bitkilerin ekilmesi, fide olduktan sonra bahçeye aktarılması için uygun zamandır. Meyve günlerinde hasat, meyvelerin ve tohumların daha iyi depolama kalitesine sahip olmasını sağlar. Bu ay, <strong>erik, şeftali ve dalından üzümler</strong> sizleri bekliyor. Ayrıca <strong>çilek, ahududu, kiraz</strong> da sizinle beraber…</p><h4 class="wp-block-heading">KÖK (TOPRAK ELEMENTİ)</h4><p>Kök bitkileri ve kök sebzeler için en uygun zaman anlamına gelmektedir. Mahsulleri kök günlerinde saklamak idealdir. Bu ayki listenizde<strong> sarımsak, havuç ve patates</strong> yer alabilir.</p><h4 class="wp-block-heading">ÇİÇEK (HAVA ELEMENTİ)</h4><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752646659.jpg" style="width: 857.625px;"></p><p><div class="col-lg-12 mt-2"><div class="row"></div></div></p><div class="row"><div class="col-12"><div class="dropcap-style-02 last-paragraph-no-margin"><div class="item-content"><p>Temmuz ayında ne ekilir? sorusunun yanıtlarından biri de çiçekler. Çiçekli bitkiler veya tıbbi amaç için kullanılan çiçekli bitkilerin, ot türlerinin ekilmesi, yer değişimleri ve hasat edilmesi için uygun zamandır.<span> </span><strong>Delphinium yani hezeran bitkisi, Haseki küpesi, yüksük otu, unutma beni bitkisi, salvia ve acı bakla</strong><span> </span>tohumları olgunlaşır ve bahçeden toplayabilirsiniz.</p><ul class="wp-block-list"><li><strong>İlginizi çekebilir:<span> </span><a href="https://www.evimdergisi.com.tr/hazeran-cicegi-bakimi-ile-ilgili-tum-detaylar-tohum-ekimi-cogaltma/" rel="noreferrer noopener" target="_blank">Hazeran çiçeği bakımı ile ilgili tüm detaylar! Tohum ekimi, çoğaltma</a></strong></li><li><a href="https://www.evimdergisi.com.tr/unutmabeni-cicegi-hikayesi-ve-ozellikleri-en-guzel-hediyelik-cicek/" rel="noreferrer noopener" target="_blank"><strong>Unutmabeni çiçeği hikayesi ve özellikleri: En güzel hediyelik çiçek</strong></a></li><li><strong></strong><strong><a href="https://www.evimdergisi.com.tr/haziran-ayinda-bitkiler-icin-yapilmasi-gerekenler/" rel="noreferrer noopener" target="_blank">Haziran ayında bitkiler için yapılması gerekenler</a></strong></li></ul><figure class="wp-block-embed is-type-wp-embed is-provider-evim wp-block-embed-evim"><div class="wp-block-embed__wrapper"></div></figure></div><span class="infinite-trigger"></span></div></div></div></div>',
