            36 => 
            array (
                'id' => 52,
                'in_title' => 'Ayna Fiziği',
                'out_title' => 'Ayna Fiziği',
                'slug' => 'ayna-fizigi-1',
                'summary' => 'Pürüzsüz ve parlak yüzeylerden yansıyan ışığın bilimi',
            'content' => '<p dir="ltr">AILSA HARVEY</p><p><b id="docs-internal-guid-3f3cbe38-7fff-d303-93f5-baf3cc83aad7"><br></b></p><p dir="ltr">İlk aynaların tarihi MÖ 6.000\'lere kadar uzanıyor, ancak insanlar binlerce yıldır su birikintilerindeki gibi doğal yansımaları kullanıyorlar. Bir aynaya baktığınızda, size geri bakan yansıma gerçek boyutlu, birebir görsel bir kopyadır. Aynaya baktığınız açı, gördüğünüz yansımayı belirler, tıpkı bir topu duvara fırlattığınızda, geri döndüğü açının duvara çarptığı açıya eşit olması gibi. Bir nesnenin kenarları yansıyan görüntünün kenarlarıyla tam olarak aynı hizada olduğundan, ayna görüntüsü gerçekliğin yatay olarak çevrilmiş bir versiyonudur. Beyniniz aynadaki görüntünüzü, yüzünü size dönmüş başka bir kişi olarak yorumlar. Örneğin sol kolunuzu kaldırdığınızda, aynadaki görüntünüz sanki sağ kolunu kaldırıyormuş gibi görünür.</p><p dir="ltr"><br></p><p dir="ltr"><br></p><p><b><br></b></p><p dir="ltr">Bir ayna, kendisine çarpan ışığın küçük bir yüzdesini soğurur ve ayna görüntülerini gerçeklikten daha sönük hale getirir</p><p><b><br></b></p><p dir="ltr">Işık sadece pürüzsüz, yansıtıcı bir yüzeyle etkileşime girdiğinde bu şekilde davranır. Buna muhteşem yansıma denir. Ancak yüzey pürüzlü olsaydı, her ışık dalgası farklı bir açıyla yansır, ışığı birden fazla yöne dağıtır ve ışığın bir görüntü halinde göze geri dönmesini engellerdi. Bu tür yansımaya dağınık yansıma denir ve doğada daha yaygındır, dalgalı su buna örnek verilebilir.</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319403.jpg" style="width: 50%;"><br></p><p><b><br></b></p><p dir="ltr">Spot:</p><p dir="ltr">“Aynaya baktığınız açı ne gördüğünüzü belirler”</p><p><b><br></b></p><p dir="ltr">Dışbükey trafik aynaları genellikle virajlar boyunca yerleştirilir, böylece sürücüler kör noktalardaki daha uzun mesafeleri görebilirler</p><p><b><br></b></p><p dir="ltr">YANSIMA TÜRLERİ</p><p dir="ltr">Aynalar yansıtıcı yüzeylerinin şekline ve ışığı nasıl yansıttıklarına göre tanımlanır. Başlıca türleri düzlem aynalar, içbükey aynalar ve dışbükey aynalardır. Düzlem aynalar yansıttıkları şeyle aynı şekil ve boyutta dik bir görüntü üretir. Bunlar görüntüyü bozmayan düz yüzeylere sahiptir. İçbükey aynalar kase şeklindedir ve içe doğru kıvrılan bir yüzeye sahiptir. Bu, ışığı tek bir odak noktasına yansıtır. Bir nesne aynaya yakın olduğunda, odaklanmış ışık görüntünün büyütülmüş bir versiyonunu üretir. Bunlar genellikle banyo aynalarının yanında tıraş sırasında veya makyaj yaparken yüzünüze yakından bakmak için kullanılır. Ayrıca teleskoplarda büyütme ve araç içi farlarda odaklanmış bir ışık demeti üretmek için kullanılırlar. Dışbükey aynalar içbükeye benzer, ancak yüzey dışa doğru kavislidir. Işık ışınları bu aynanın yüzeyine çarptıktan sonra dışa doğru yayılarak görüntüyü küçültür. Bu da görüş alanını genişleterek dışbükey aynaları güvenlik aynaları ve araba dikiz aynaları için ideal hale getirir.</p><p><b><br></b></p><p dir="ltr">AYNA ÜRETİMİ</p><p dir="ltr">Aynalar, net bir yansıma oluşturmak için nasıl üretilir?</p><p dir="ltr">Aynalar genellikle camın ince bir alüminyum veya gümüş tabakasıyla kaplanmasıyla üretilir. Cam istenilen şekil ve boyutta kesilip parlatıldıktan sonra pürüzsüz ve kirletici içermeyen bir yüzey elde etmek için temizlenir. Arka yüzeye ince bir kalay klorür tabakası uygulanana kadar metal camla iyi bir şekilde birleşmez. Bu sadece metalin panele bağlanmasına yardımcı olmakla kalmaz, aynı zamanda gümüş nitrattan gelen gümüş iyonlarını azaltarak geride yansıtıcı bir metalik gümüş tabaka bırakır. Gümüş, sıvı halde aynanın arkasına püskürtülür. Bu gümüş kalay bileşiği ile temas ettiğinde saniyeler içinde sertleşir ve cam yüksek oranda yansıtıcı hale gelir. Gümüşten sonra aynanın arkasına boya ve bakır da eklenerek cama güç kazandırılır. Gümüş en yansıtıcı metallerden biridir ve görünür ışığın %95\'ini geri yansıtır. Cam, net bir yansıma için gümüş yüzeyi korumak amacıyla metalin üstünde kullanılır. Şeffaflığı, gümüş havaya maruz kalmadan ışığın metale ulaşmasını sağlar.</p><p><b><br></b></p><p dir="ltr">Büyük cam levhalar ayna fabrikasında kesildikten sonra yansıtıcı metalle kaplanmayı bekliyor</p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319405.jpg" style="width: 647px;"><b><br></b></p><p dir="ltr">Biliyor muydunuz? Dünyanın en büyük doğal aynası, Bolivya\'da bulunan ve New York\'tan sekiz kat daha geniş bir tuz düzlüğü olan Salar de Uyuni\'dir</p><p><b><br></b></p><p dir="ltr">Biliyor muydunuz? İlk aynalar koyu renkli, su dolu kaplardı.</p><p><b><br></b></p><p dir="ltr">IŞIK NASIL YANSIR?</p><p dir="ltr">Yansıtıcı malzemeler ayna görüntüsü oluşturmak için ışığı büker ve yönlendirir</p><p><b><br></b></p><p dir="ltr">OLAY AÇISI</p><p dir="ltr">Bu, gelen bir ışık ışını ile ışığın temas noktasından aynanın yüzeyine 90 derecede olan hayali bir dikme (normal) ile arasındaki açıdır.</p><p><b><br></b></p><p dir="ltr">YANSIMA AÇISI</p><p dir="ltr">Bu açı, normal ile yansıyan ışın arasındadır.</p><p><b><br></b></p><p dir="ltr">YANSIMA KANUNU</p><p dir="ltr">Işığın yansıdığı açı ya da yansıma açısı her zaman ışığın aynaya çarptığı açıya, yani geliş açısına eşittir.</p><p><b><br></b></p><p dir="ltr">AYNA</p><p dir="ltr">Bu bir düzlem aynadır ve gözlemcinin, arının aynanın arkasında, gerçek arının önünde olduğu mesafeyle aynı mesafede görünen dik bir yansımasını gözlemlemesine neden olur.</p><p><b><br></b></p><p dir="ltr">YANSIYAN IŞINLAR</p><p dir="ltr">Yansıyan ışınlar aynadan geri döndüğünde, beyniniz görüntüyü aynanın arkasından geliyormuş gibi yorumlar.</p><p><br></p><p dir="ltr">Durgun su yansıtıcı bir yüzey gibi davranır</p>',
                'large_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319700.jpg',
                'news_detail_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319700.jpg',
                'list_image' => 'https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319700.jpg',
                'is_published' => 1,
                'viewed' => 0,
                'published_at' => '2025-07-16 20:10:09',
                'published_by' => 3,
                'category_id' => 2,
                'magazine_id' => 22,
                'meta_title' => NULL,
                'meta_description' => NULL,
                'meta_keywords' => NULL,
