                'id' => 54,
                'in_title' => 'Sen, ben ve Jennie',
                'out_title' => 'Sen, ben ve Jennie',
                'slug' => 'sen-ben-ve-jennie-1',
                'summary' => 'Jennie, 2019’da çıkardığı “Solo”nun ardından solo çalışmalarını “You & Me” ile devam ettiriyor.',
                'content' => '<p dir="ltr">Yazı İrem Naz Güvel</p><p><b id="docs-internal-guid-df4aeaa0-7fff-6685-276f-ddff0a4842c9"><br></b></p><p dir="ltr">Hayranlara özel</p><p dir="ltr">“You &amp; Me” Jennie’nin ikinci solo single’ı. Şarkı canlı bir dans-pop ritmine sahip olup sarsılmaz bir aşkın ateşli öyküsünü anlatıyor. Aslında bu büyüleyici şarkıyı geçen yıl Blackpink’in Born Pink Dünya Turnesi kapsamında Jennie’nin solo performansı olarak dinlemiştik. Turne tamamlandıktan sonra idol, merakla beklenen parçasını hayranlara özel bir hediye olarak yayınlandı.</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319962.jpg" style="width: 50%;"><br></p><p><b><br></b></p><p dir="ltr">Teddy ile çalıştı</p><p dir="ltr">Jennie’den öğrendiğimize göre şarkının geçmişi tahmin ettiğimizden de eskiymiş. İdol, “You &amp; Me”yi yaklaşık 3-4 yıl önce kaydettiğini açıklayıp devam ediyor: “Sanırım bu şarkı, solom için adaylar listesindeydi. Bir süredir dolapta duruyordu ama turneye hazırlanırken yapımcı Teddy ile ne tür performanslar ve şarkılar yapmak istediğimi düşündüm. Böylece geçmiş şarkılara baktım. Sevdiğimiz bu şarkıyı çıkarmaya karar verdik ve şarkıyı hazırlamaya başladık. Bunu nasıl gerçekleştirmek istediğime dair kafamda bir sürü fikir vardı, bu yüzden koreograflar Eunchong ve Jung bunu gerçeğe dönüştürmemde bana yardımcı oldular.”</p><p dir="ltr"><br></p><p dir="ltr"><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319965.jpg" style="width: 316px;"><br></p><p><b><br></b></p><p dir="ltr">Ay Savaşçısı Jennie</p><p dir="ltr">Şarkının sözleri, aşık olmak ve aşk söz konusu olduğunda her türlü korkuyu bırakmaya hazır olmak hakkında. Şarkıda Jennie, “Seni ve beni seviyorum / Ay ışığında dans ediyorum” diyerek sevgilisiyle olan bağlantısı dışında hiçbir şeyin onun için önemli olmadığını vurguluyor. Ayrıca single’ın kapak görseli, Jennie’nin aynı zamanda bir ürün koleksiyonu üzerinde de birlikte çalışacağı “Sailor Moon” animesinin yaratıcısı Naoko Takeuchi tarafından çizildi. Kapakta Jennie, gerçekten de bir Ay Savaşçısı gibi görünüyor.</p><p><b><br></b></p><p><img src="https://past-service.s3.eu-north-1.amazonaws.com/bmag/1752319964.jpg" style="width: 50%;"><b><br></b></p><p dir="ltr">Blackpink dağılıyor mu?</p><p></p><p dir="ltr">Jennie, “You &amp; Me”yi, Güney Kore medyasının bazı Blackpink üyelerinin YG Entertainment ile sözleşmelerini yenilemeyebileceği yönündeki haberlerinin ortasında yayınladı. Ancak YG, görüşmelerin devam ettiğini ve grubun sözleşmelerine ilişkin hiçbir şeyin onaylanmadığını ileri sürdü. Şu zamana kadar kulağımıza birçok söylenti geldi. Bunlardan biri de Rose hariç diğer Blackpink üyelerinin şirketten ayrılacağı ve ayrı yerlerden grubu devam ettireceği yönünde. İşin doğrusunu ve Blackpink’in akıbetini öğrenmek için beklemekten başka bir şansımız yok.</p><div><br></div>',
