                'id' => 57,
                'in_title' => 'Mert Fırat\'ın yatırım yaparken odaklandığı 3 alan',
                'out_title' => 'Mert Fırat\'ın yatırım yaparken odaklandığı 3 alan',
                'slug' => 'mert-firatin-yatirim-yaparken-odaklandigi-3-alan-1',
                'summary' => 'Mert Fırat, sadece başarılı bir oyuncu değil aynı zamanda Türkiye’nin girişimcilik ekosisteminde güçlü bir oyun kurucu.',
                'content' => '<p>Sanat, teknoloji, sağlık, eğitim ve sürdürülebilirlik gibi farklı alanlardaki girişimleriyle çok yönlü bir etki yaratıyor. “Yaptığımher işin topluma dokunmasını, anlamlı bir karşılığı olmasını önemsiyorum” diyen Fırat, yapay zekadan gıdaya uzanan yeni projelerle etki alanını daha da genişletmeye hazırlanıyor.</p><p>Mert Fırat\'ın şu an doğrudan kurucusu ya da kurucu ortağı olduğu 10’un üzerinde girişim var. Mert Fırat<strong>, "Yatırım yaparken de üç temel alana odaklanıyorum: Teknoloji, sağlık ve sosyal yaşam. Anne-çocuk sağlığı, uzaktan eğitim, sürdürülebilir yaşam çözümleri gibi konular beni özellikle cezbediyor. Örneğin, ekran süresini avantaja çevirmeyi amaçlayan kaliteli içerik platformu üzerine bir eğitimci arkadaşımla yeni bir proje geliştiriyoruz" </strong>diyor.</p><p>Mert Fırat\'ın yatırım stratejileri, girişimleri ve röportajın tamamı Start Up dergisinin Haziran-Ağustos sayısında. <a href="https://dergiburda.com/product/detail/start-up" target="_blank">Satın almak için tıklayın</a></p><p><br></p>',
